": "function:src.flask.templating::list_templates", "label": "list_templates", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.templating::list_templates\u0027, \u0027module\u0027: \u0027src.flask.templating\u0027, \u0027name\u0027: \u0027list_templates\u0027, \u0027path\u0027: \u0027src/flask/templating.py\u0027, \u0027start_line\u0027: 111, \u0027end_line\u0027: 123, \u0027docstring\u0027: None, \u0027num_calls\u0027: 7, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.templating::generate", "label": "generate", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.templating::generate\u0027, \u0027module\u0027: \u0027src.flask.templating\u0027, \u0027name\u0027: \u0027generate\u0027, \u0027path\u0027: \u0027src/flask/templating.py\u0027, \u0027start_line\u0027: 173, \u0027end_line\u0027: 177, \u0027docstring\u0027: None, \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.helpers::get_debug_flag", "label": "get_debug_flag", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.helpers::get_debug_flag\u0027, \u0027module\u0027: \u0027src.flask.helpers\u0027, \u0027name\u0027: \u0027get_debug_flag\u0027, \u0027path\u0027: \u0027src/flask/helpers.py\u0027, \u0027start_line\u0027: 27, \u0027end_line\u0027: 32, \u0027docstring\u0027: \u0027Get whether debug mode should be enabled for the app, indicated by the\\n:envvar:`FLASK_DEBUG` environment variable. The default is ``False``.\u0027, \u0027num_calls\u0027: 3, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.helpers::get_load_dotenv", "label": "get_load_dotenv", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.helpers::get_load_dotenv\u0027, \u0027module\u0027: \u0027src.flask.helpers\u0027, \u0027name\u0027: \u0027get_load_dotenv\u0027, \u0027path\u0027: \u0027src/flask/helpers.py\u0027, \u0027start_line\u0027: 35, \u0027end_line\u0027: 47, \u0027docstring\u0027: \"Get whether the user has disabled loading default dotenv files by\\nsetting :envvar:`FLASK_SKIP_DOTENV`. The default is ``True``, load\\nthe files.\\n\\n:param default: What to return if the env var isn\u0027t set.\", \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.helpers::stream_with_context", "label": "stream_with_context", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.helpers::stream_with_context\u0027, \u0027module\u0027: \u0027src.flask.helpers\u0027, \u0027name\u0027: \u0027stream_with_context\u0027, \u0027path\u0027: \u0027src/flask/helpers.py\u0027, \u0027start_line\u0027: 62, \u0027end_line\u0027: 135, \u0027docstring\u0027: \u0027Wrap a response generator function so that it runs inside the current\\nrequest context. This keeps :data:`.request`, :data:`.session`, and :data:`.g`\\navailable, even though at the point the generator runs the request context\\nwill typically have ended.\\n\\nUse it as a decorator on a generator function:\\n\\n.. code-block:: python\\n\\n    from flask import stream_with_context, request, Response\\n\\n    @app.get(\"/stream\")\\n    def streamed_response():\\n        @stream_with_context\\n        def generate():\\n            yield \"Hello \"\\n            yield request.args[\"name\"]\\n            yield \"!\"\\n\\n        return Response(generate())\\n\\nOr use it as a wrapper around a created generator:\\n\\n.. code-block:: python\\n\\n    from flask import stream_with_context, request, Response\\n\\n    @app.get(\"/stream\")\\n    def streamed_response():\\n        def generate():\\n            yield \"Hello \"\\n            yield request.args[\"name\"]\\n            yield \"!\"\\n\\n        return Response(stream_with_context(generate()))\\n\\n.. versionadded:: 0.9\u0027, \u0027num_calls\u0027: 10, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.helpers::make_response", "label": "make_response", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.helpers::make_response\u0027, \u0027module\u0027: \u0027src.flask.helpers\u0027, \u0027name\u0027: \u0027make_response\u0027, \u0027path\u0027: \u0027src/flask/helpers.py\u0027, \u0027start_line\u0027: 138, \u0027end_line\u0027: 184, \u0027docstring\u0027: \"Sometimes it is necessary to set additional headers in a view.  Because\\nviews do not have to return response objects but can return a value that\\nis converted into a response object by Flask itself, it becomes tricky to\\nadd headers to it.  This function can be called instead of using a return\\nand you will get a response object which you can use to attach headers.\\n\\nIf view looked like this and you want to add a new header::\\n\\n    def index():\\n        return render_template(\u0027index.html\u0027, foo=42)\\n\\nYou can now do something like this::\\n\\n    def index():\\n        response = make_response(render_template(\u0027index.html\u0027, foo=42))\\n        response.headers[\u0027X-Parachutes\u0027] = \u0027parachutes are cool\u0027\\n        return response\\n\\nThis function accepts the very same arguments you can return from a\\nview function.  This for example creates a response with a 404 error\\ncode::\\n\\n    response = make_response(render_template(\u0027not_found.html\u0027), 404)\\n\\nThe other use case of this function is to force the return value of a\\nview function into a response which is helpful with view\\ndecorators::\\n\\n    response = make_response(view_function())\\n    response.headers[\u0027X-Parachutes\u0027] = \u0027parachutes are cool\u0027\\n\\nInternally this function does the following things:\\n\\n-   if no arguments are passed, it creates a new response argument\\n-   if one argument is passed, :meth:`flask.Flask.make_response`\\n    is invoked with it.\\n-   if more than one argument is passed, the arguments are passed\\n    to the :meth:`flask.Flask.make_response` function as tuple.\\n\\n.. versionadded:: 0.6\", \u0027num_calls\u0027: 3, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.helpers::url_for", "label": "url_for", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.helpers::url_for\u0027, \u0027module\u0027: \u0027src.flask.helpers\u0027, \u0027name\u0027: \u0027url_for\u0027, \u0027path\u0027: \u0027src/flask/helpers.py\u0027, \u0027start_line\u0027: 187, \u0027end_line\u0027: 238, \u0027docstring\u0027: \u0027Generate a URL to the given endpoint with the given values.\\n\\nThis requires an active request or application context, and calls\\n:meth:`current_app.url_for() \u003cflask.Flask.url_for\u003e`. See that method\\nfor full documentation.\\n\\n:param endpoint: The endpoint name associated with the URL to\\n    generate. If this starts with a ``.``, the current blueprint\\n    name (if any) will be used.\\n:param _anchor: If given, append this as ``#anchor`` to the URL.\\n:param _method: If given, generate the URL associated with this\\n    method for the endpoint.\\n:param _scheme: If given, the URL will have this scheme if it is\\n    external.\\n:param _external: If given, prefer the URL to be internal (False) or\\n    require it to be external (True). External URLs include the\\n    scheme and domain. When not in an active request, URLs are\\n    external by default.\\n:param values: Values to use for the variable parts of the URL rule.\\n    Unknown keys are appended as query string arguments, like\\n    ``?a=b\u0026c=d``.\\n\\n.. versionchanged:: 2.2\\n    Calls ``current_app.url_for``, allowing an app to override the\\n    behavior.\\n\\n.. versionchanged:: 0.10\\n   The ``_scheme`` parameter was added.\\n\\n.. versionchanged:: 0.9\\n   The ``_anchor`` and ``_method`` parameters were added.\\n\\n.. versionchanged:: 0.9\\n   Calls ``app.handle_url_build_error`` on build errors.\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.helpers::redirect", "label": "redirect", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.helpers::redirect\u0027, \u0027module\u0027: \u0027src.flask.helpers\u0027, \u0027name\u0027: \u0027redirect\u0027, \u0027path\u0027: \u0027src/flask/helpers.py\u0027, \u0027start_line\u0027: 241, \u0027end_line\u0027: 262, \u0027docstring\u0027: \"Create a redirect response object.\\n\\nIf :data:`~flask.current_app` is available, it will use its\\n:meth:`~flask.Flask.redirect` method, otherwise it will use\\n:func:`werkzeug.utils.redirect`.\\n\\n:param location: The URL to redirect to.\\n:param code: The status code for the redirect.\\n:param Response: The response class to use. Not used when\\n    ``current_app`` is active, which uses ``app.response_class``.\\n\\n.. versionadded:: 2.2\\n    Calls ``current_app.redirect`` if available instead of always\\n    using Werkzeug\u0027s default ``redirect``.\", \u0027num_calls\u0027: 3, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.helpers::abort", "label": "abort", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.helpers::abort\u0027, \u0027module\u0027: \u0027src.flask.helpers\u0027, \u0027name\u0027: \u0027abort\u0027, \u0027path\u0027: \u0027src/flask/helpers.py\u0027, \u0027start_line\u0027: 265, \u0027end_line\u0027: 285, \u0027docstring\u0027: \"Raise an :exc:`~werkzeug.exceptions.HTTPException` for the given\\nstatus code.\\n\\nIf :data:`~flask.current_app` is available, it will call its\\n:attr:`~flask.Flask.aborter` object, otherwise it will use\\n:func:`werkzeug.exceptions.abort`.\\n\\n:param code: The status code for the exception, which must be\\n    registered in ``app.aborter``.\\n:param args: Passed to the exception.\\n:param kwargs: Passed to the exception.\\n\\n.. versionadded:: 2.2\\n    Calls ``current_app.aborter`` if available instead of always\\n    using Werkzeug\u0027s default ``abort``.\", \u0027num_calls\u0027: 3, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.helpers::get_template_attribute", "label": "get_template_attribute", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.helpers::get_template_attribute\u0027, \u0027module\u0027: \u0027src.flask.helpers\u0027, \u0027name\u0027: \u0027get_template_attribute\u0027, \u0027path\u0027: \u0027src/flask/helpers.py\u0027, \u0027start_line\u0027: 288, \u0027end_line\u0027: 307, \u0027docstring\u0027: \"Loads a macro (or variable) a template exports.  This can be used to\\ninvoke a macro from within Python code.  If you for example have a\\ntemplate named :file:`_cider.html` with the following contents:\\n\\n.. sourcecode:: html+jinja\\n\\n   {% macro hello(name) %}Hello {{ name }}!{% endmacro %}\\n\\nYou can access this from Python code like this::\\n\\n    hello = get_template_attribute(\u0027_cider.html\u0027, \u0027hello\u0027)\\n    return hello(\u0027World\u0027)\\n\\n.. versionadded:: 0.2\\n\\n:param template_name: the name of the template\\n:param attribute: the name of the variable of macro to access\", \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.helpers::flash", "label": "flash", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.helpers::flash\u0027, \u0027module\u0027: \u0027src.flask.helpers\u0027, \u0027name\u0027: \u0027flash\u0027, \u0027path\u0027: \u0027src/flask/helpers.py\u0027, \u0027start_line\u0027: 310, \u0027end_line\u0027: 341, \u0027docstring\u0027: \"Flashes a message to the next request.  In order to remove the\\nflashed message from the session and to display it to the user,\\nthe template has to call :func:`get_flashed_messages`.\\n\\n.. versionchanged:: 0.3\\n   `category` parameter added.\\n\\n:param message: the message to be flashed.\\n:param category: the category for the message.  The following values\\n                 are recommended: ``\u0027message\u0027`` for any kind of message,\\n                 ``\u0027error\u0027`` for errors, ``\u0027info\u0027`` for information\\n                 messages and ``\u0027warning\u0027`` for warnings.  However any\\n                 kind of string can be used as category.\", \u0027num_calls\u0027: 4, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.helpers::get_flashed_messages", "label": "get_flashed_messages", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.helpers::get_flashed_messages\u0027, \u0027module\u0027: \u0027src.flask.helpers\u0027, \u0027name\u0027: \u0027get_flashed_messages\u0027, \u0027path\u0027: \u0027src/flask/helpers.py\u0027, \u0027start_line\u0027: 344, \u0027end_line\u0027: 383, \u0027docstring\u0027: \u0027Pulls all flashed messages from the session and returns them.\\nFurther calls in the same request to the function will return\\nthe same messages.  By default just the messages are returned,\\nbut when `with_categories` is set to ``True``, the return value will\\nbe a list of tuples in the form ``(category, message)`` instead.\\n\\nFilter the flashed messages to one or more categories by providing those\\ncategories in `category_filter`.  This allows rendering categories in\\nseparate html blocks.  The `with_categories` and `category_filter`\\narguments are distinct:\\n\\n* `with_categories` controls whether categories are returned with message\\n  text (``True`` gives a tuple, where ``False`` gives just the message text).\\n* `category_filter` filters the messages down to only those matching the\\n  provided categories.\\n\\nSee :doc:`/patterns/flashing` for examples.\\n\\n.. versionchanged:: 0.3\\n   `with_categories` parameter added.\\n\\n.. versionchanged:: 0.9\\n    `category_filter` parameter added.\\n\\n:param with_categories: set to ``True`` to also receive categories.\\n:param category_filter: filter of categories to limit return values.  Only\\n                        categories in the list will be returned.\u0027, \u0027num_calls\u0027: 3, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.helpers::_prepare_send_file_kwargs", "label": "_prepare_send_file_kwargs", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.helpers::_prepare_send_file_kwargs\u0027, \u0027module\u0027: \u0027src.flask.helpers\u0027, \u0027name\u0027: \u0027_prepare_send_file_kwargs\u0027, \u0027path\u0027: \u0027src/flask/helpers.py\u0027, \u0027start_line\u0027: 386, \u0027end_line\u0027: 398, \u0027docstring\u0027: None, \u0027num_calls\u0027: 3, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.helpers::send_file", "label": "send_file", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.helpers::send_file\u0027, \u0027module\u0027: \u0027src.flask.helpers\u0027, \u0027name\u0027: \u0027send_file\u0027, \u0027path\u0027: \u0027src/flask/helpers.py\u0027, \u0027start_line\u0027: 401, \u0027end_line\u0027: 524, \u0027docstring\u0027: \"Send the contents of a file to the client.\\n\\nThe first argument can be a file path or a file-like object. Paths\\nare preferred in most cases because Werkzeug can manage the file and\\nget extra information from the path. Passing a file-like object\\nrequires that the file is opened in binary mode, and is mostly\\nuseful when building a file in memory with :class:`io.BytesIO`.\\n\\nNever pass file paths provided by a user. The path is assumed to be\\ntrusted, so a user could craft a path to access a file you didn\u0027t\\nintend. Use :func:`send_from_directory` to safely serve\\nuser-requested paths from within a directory.\\n\\nIf the WSGI server sets a ``file_wrapper`` in ``environ``, it is\\nused, otherwise Werkzeug\u0027s built-in wrapper is used. Alternatively,\\nif the HTTP server supports ``X-Sendfile``, configuring Flask with\\n``USE_X_SENDFILE = True`` will tell the server to send the given\\npath, which is much more efficient than reading it in Python.\\n\\n:param path_or_file: The path to the file to send, relative to the\\n    current working directory if a relative path is given.\\n    Alternatively, a file-like object opened in binary mode. Make\\n    sure the file pointer is seeked to the start of the data.\\n:param mimetype: The MIME type to send for the file. If not\\n    provided, it will try to detect it from the file name.\\n:param as_attachment: Indicate to a browser that it should offer to\\n    save the file instead of displaying it.\\n:param download_name: The default name browsers will use when saving\\n    the file. Defaults to the passed file name.\\n:param conditional: Enable conditional and range responses based on\\n    request headers. Requires passing a file path and ``environ``.\\n:param etag: Calculate an ETag for the file, which requires passing\\n    a file path. Can also be a string to use instead.\\n:param last_modified: The last modified time to send for the file,\\n    in seconds. If not provided, it will try to detect it from the\\n    file path.\\n:param max_age: How long the client should cache the file, in\\n    seconds. If set, ``Cache-Control`` will be ``public``, otherwise\\n    it will be ``no-cache`` to prefer conditional caching.\\n\\n.. versionchanged:: 2.0\\n    ``download_name`` replaces the ``attachment_filename``\\n    parameter. If ``as_attachment=False``, it is passed with\\n    ``Content-Disposition: inline`` instead.\\n\\n.. versionchanged:: 2.0\\n    ``max_age`` replaces the ``cache_timeout`` parameter.\\n    ``conditional`` is enabled and ``max_age`` is not set by\\n    default.\\n\\n.. versionchanged:: 2.0\\n    ``etag`` replaces the ``add_etags`` parameter. It can be a\\n    string to use instead of generating one.\\n\\n.. versionchanged:: 2.0\\n    Passing a file-like object that inherits from\\n    :class:`~io.TextIOBase` will raise a :exc:`ValueError` rather\\n    than sending an empty file.\\n\\n.. versionadded:: 2.0\\n    Moved the implementation to Werkzeug. This is now a wrapper to\\n    pass some Flask-specific arguments.\\n\\n.. versionchanged:: 1.1\\n    ``filename`` may be a :class:`~os.PathLike` object.\\n\\n.. versionchanged:: 1.1\\n    Passing a :class:`~io.BytesIO` object supports range requests.\\n\\n.. versionchanged:: 1.0.3\\n    Filenames are encoded with ASCII instead of Latin-1 for broader\\n    compatibility with WSGI servers.\\n\\n.. versionchanged:: 1.0\\n    UTF-8 filenames as specified in :rfc:`2231` are supported.\\n\\n.. versionchanged:: 0.12\\n    The filename is no longer automatically inferred from file\\n    objects. If you want to use automatic MIME and etag support,\\n    pass a filename via ``filename_or_fp`` or\\n    ``attachment_filename``.\\n\\n.. versionchanged:: 0.12\\n    ``attachment_filename`` is preferred over ``filename`` for MIME\\n    detection.\\n\\n.. versionchanged:: 0.9\\n    ``cache_timeout`` defaults to\\n    :meth:`Flask.get_send_file_max_age`.\\n\\n.. versionchanged:: 0.7\\n    MIME guessing and etag support for file-like objects was\\n    removed because it was unreliable. Pass a filename if you are\\n    able to, otherwise attach an etag yourself.\\n\\n.. versionchanged:: 0.5\\n    The ``add_etags``, ``cache_timeout`` and ``conditional``\\n    parameters were added. The default behavior is to add etags.\\n\\n.. versionadded:: 0.2\", \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.helpers::send_from_directory", "label": "send_from_directory", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.helpers::send_from_directory\u0027, \u0027module\u0027: \u0027src.flask.helpers\u0027, \u0027name\u0027: \u0027send_from_directory\u0027, \u0027path\u0027: \u0027src/flask/helpers.py\u0027, \u0027start_line\u0027: 527, \u0027end_line\u0027: 568, \u0027docstring\u0027: \u0027Send a file from within a directory using :func:`send_file`.\\n\\n.. code-block:: python\\n\\n    @app.route(\"/uploads/\u003cpath:name\u003e\")\\n    def download_file(name):\\n        return send_from_directory(\\n            app.config[\\\u0027UPLOAD_FOLDER\\\u0027], name, as_attachment=True\\n        )\\n\\nThis is a secure way to serve files from a folder, such as static\\nfiles or uploads. Uses :func:`~werkzeug.security.safe_join` to\\nensure the path coming from the client is not maliciously crafted to\\npoint outside the specified directory.\\n\\nIf the final path does not point to an existing regular file,\\nraises a 404 :exc:`~werkzeug.exceptions.NotFound` error.\\n\\n:param directory: The directory that ``path`` must be located under,\\n    relative to the current application\\\u0027s root path. This *must not*\\n    be a value provided by the client, otherwise it becomes insecure.\\n:param path: The path to the file to send, relative to\\n    ``directory``.\\n:param kwargs: Arguments to pass to :func:`send_file`.\\n\\n.. versionchanged:: 2.0\\n    ``path`` replaces the ``filename`` parameter.\\n\\n.. versionadded:: 2.0\\n    Moved the implementation to Werkzeug. This is now a wrapper to\\n    pass some Flask-specific arguments.\\n\\n.. versionadded:: 0.5\u0027, \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.helpers::get_root_path", "label": "get_root_path", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.helpers::get_root_path\u0027, \u0027module\u0027: \u0027src.flask.helpers\u0027, \u0027name\u0027: \u0027get_root_path\u0027, \u0027path\u0027: \u0027src/flask/helpers.py\u0027, \u0027start_line\u0027: 571, \u0027end_line\u0027: 625, \u0027docstring\u0027: \u0027Find the root path of a package, or the path that contains a\\nmodule. If it cannot be found, returns the current working\\ndirectory.\\n\\nNot to be confused with the value returned by :func:`find_package`.\\n\\n:meta private:\u0027, \u0027num_calls\u0027: 13, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.helpers::_split_blueprint_path", "label": "_split_blueprint_path", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.helpers::_split_blueprint_path\u0027, \u0027module\u0027: \u0027src.flask.helpers\u0027, \u0027name\u0027: \u0027_split_blueprint_path\u0027, \u0027path\u0027: \u0027src/flask/helpers.py\u0027, \u0027start_line\u0027: 629, \u0027end_line\u0027: 635, \u0027docstring\u0027: None, \u0027num_calls\u0027: 3, \u0027decorators\u0027: [\u0027cache\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.helpers::generator", "label": "generator", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.helpers::generator\u0027, \u0027module\u0027: \u0027src.flask.helpers\u0027, \u0027name\u0027: \u0027generator\u0027, \u0027path\u0027: \u0027src/flask/helpers.py\u0027, \u0027start_line\u0027: 113, \u0027end_line\u0027: 128, \u0027docstring\u0027: None, \u0027num_calls\u0027: 4, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.helpers::decorator", "label": "decorator", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.helpers::decorator\u0027, \u0027module\u0027: \u0027src.flask.helpers\u0027, \u0027name\u0027: \u0027decorator\u0027, \u0027path\u0027: \u0027src/flask/helpers.py\u0027, \u0027start_line\u0027: 107, \u0027end_line\u0027: 109, \u0027docstring\u0027: None, \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::_make_timedelta", "label": "_make_timedelta", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::_make_timedelta\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027_make_timedelta\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 69, \u0027end_line\u0027: 73, \u0027docstring\u0027: None, \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::Flask", "label": "Flask", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::Flask\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027Flask\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 76, \u0027end_line\u0027: 1500, \u0027docstring\u0027: \"The flask object implements a WSGI application and acts as the central\\nobject.  It is passed the name of the module or package of the\\napplication.  Once it is created it will act as a central registry for\\nthe view functions, the URL rules, template configuration and much more.\\n\\nThe name of the package is used to resolve resources from inside the\\npackage or the folder the module is contained in depending on if the\\npackage parameter resolves to an actual python package (a folder with\\nan :file:`__init__.py` file inside) or a standard module (just a ``.py`` file).\\n\\nFor more information about resource loading, see :func:`open_resource`.\\n\\nUsually you create a :class:`Flask` instance in your main module or\\nin the :file:`__init__.py` file of your package like this::\\n\\n    from flask import Flask\\n    app = Flask(__name__)\\n\\n.. admonition:: About the First Parameter\\n\\n    The idea of the first parameter is to give Flask an idea of what\\n    belongs to your application.  This name is used to find resources\\n    on the filesystem, can be used by extensions to improve debugging\\n    information and a lot more.\\n\\n    So it\u0027s important what you provide there.  If you are using a single\\n    module, `__name__` is always the correct value.  If you however are\\n    using a package, it\u0027s usually recommended to hardcode the name of\\n    your package there.\\n\\n    For example if your application is defined in :file:`yourapplication/app.py`\\n    you should create it with one of the two versions below::\\n\\n        app = Flask(\u0027yourapplication\u0027)\\n        app = Flask(__name__.split(\u0027.\u0027)[0])\\n\\n    Why is that?  The application will work even with `__name__`, thanks\\n    to how resources are looked up.  However it will make debugging more\\n    painful.  Certain extensions can make assumptions based on the\\n    import name of your application.  For example the Flask-SQLAlchemy\\n    extension will look for the code in your application that triggered\\n    an SQL query in debug mode.  If the import name is not properly set\\n    up, that debugging information is lost.  (For example it would only\\n    pick up SQL queries in `yourapplication.app` and not\\n    `yourapplication.views.frontend`)\\n\\n.. versionadded:: 0.7\\n   The `static_url_path`, `static_folder`, and `template_folder`\\n   parameters were added.\\n\\n.. versionadded:: 0.8\\n   The `instance_path` and `instance_relative_config` parameters were\\n   added.\\n\\n.. versionadded:: 0.11\\n   The `root_path` parameter was added.\\n\\n.. versionadded:: 1.0\\n   The ``host_matching`` and ``static_host`` parameters were added.\\n\\n.. versionadded:: 1.0\\n   The ``subdomain_matching`` parameter was added. Subdomain\\n   matching needs to be enabled manually now. Setting\\n   :data:`SERVER_NAME` does not implicitly enable it.\\n\\n:param import_name: the name of the application package\\n:param static_url_path: can be used to specify a different path for the\\n                        static files on the web.  Defaults to the name\\n                        of the `static_folder` folder.\\n:param static_folder: The folder with static files that is served at\\n    ``static_url_path``. Relative to the application ``root_path``\\n    or an absolute path. Defaults to ``\u0027static\u0027``.\\n:param static_host: the host to use when adding the static route.\\n    Defaults to None. Required when using ``host_matching=True``\\n    with a ``static_folder`` configured.\\n:param host_matching: set ``url_map.host_matching`` attribute.\\n    Defaults to False.\\n:param subdomain_matching: consider the subdomain relative to\\n    :data:`SERVER_NAME` when matching routes. Defaults to False.\\n:param template_folder: the folder that contains the templates that should\\n                        be used by the application.  Defaults to\\n                        ``\u0027templates\u0027`` folder in the root path of the\\n                        application.\\n:param instance_path: An alternative instance path for the application.\\n                      By default the folder ``\u0027instance\u0027`` next to the\\n                      package or module is assumed to be the instance\\n                      path.\\n:param instance_relative_config: if set to ``True`` relative filenames\\n                                 for loading the config are assumed to\\n                                 be relative to the instance path instead\\n                                 of the application root.\\n:param root_path: The path to the root of the application files.\\n    This should only be set manually when it can\u0027t be detected\\n    automatically, such as for namespace packages.\", \u0027num_calls\u0027: 167, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::__init__", "label": "__init__", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::__init__\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027__init__\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 221, \u0027end_line\u0027: 274, \u0027docstring\u0027: None, \u0027num_calls\u0027: 8, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::get_send_file_max_age", "label": "get_send_file_max_age", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::get_send_file_max_age\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027get_send_file_max_age\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 276, \u0027end_line\u0027: 301, \u0027docstring\u0027: \"Used by :func:`send_file` to determine the ``max_age`` cache\\nvalue for a given file path if it wasn\u0027t passed.\\n\\nBy default, this returns :data:`SEND_FILE_MAX_AGE_DEFAULT` from\\nthe configuration of :data:`~flask.current_app`. This defaults\\nto ``None``, which tells the browser to use conditional requests\\ninstead of a timed cache, which is usually preferable.\\n\\nNote this is a duplicate of the same method in the Flask\\nclass.\\n\\n.. versionchanged:: 2.0\\n    The default configuration is ``None`` instead of 12 hours.\\n\\n.. versionadded:: 0.9\", \u0027num_calls\u0027: 3, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::send_static_file", "label": "send_static_file", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::send_static_file\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027send_static_file\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 303, \u0027end_line\u0027: 323, \u0027docstring\u0027: \u0027The view function used to serve files from\\n:attr:`static_folder`. A route is automatically registered for\\nthis view at :attr:`static_url_path` if :attr:`static_folder` is\\nset.\\n\\nNote this is a duplicate of the same method in the Flask\\nclass.\\n\\n.. versionadded:: 0.5\u0027, \u0027num_calls\u0027: 4, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::open_resource", "label": "open_resource", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::open_resource\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027open_resource\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 325, \u0027end_line\u0027: 356, \u0027docstring\u0027: \u0027Open a resource file relative to :attr:`root_path` for reading.\\n\\nFor example, if the file ``schema.sql`` is next to the file\\n``app.py`` where the ``Flask`` app is defined, it can be opened\\nwith:\\n\\n.. code-block:: python\\n\\n    with app.open_resource(\"schema.sql\") as f:\\n        conn.executescript(f.read())\\n\\n:param resource: Path to the resource relative to :attr:`root_path`.\\n:param mode: Open the file in this mode. Only reading is supported,\\n    valid values are ``\"r\"`` (or ``\"rt\"``) and ``\"rb\"``.\\n:param encoding: Open the file with this encoding when opening in text\\n    mode. This is ignored when opening in binary mode.\\n\\n.. versionchanged:: 3.1\\n    Added the ``encoding`` parameter.\u0027, \u0027num_calls\u0027: 4, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::open_instance_resource", "label": "open_instance_resource", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::open_instance_resource\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027open_instance_resource\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 358, \u0027end_line\u0027: 378, \u0027docstring\u0027: \"Open a resource file relative to the application\u0027s instance folder\\n:attr:`instance_path`. Unlike :meth:`open_resource`, files in the\\ninstance folder can be opened for writing.\\n\\n:param resource: Path to the resource relative to :attr:`instance_path`.\\n:param mode: Open the file in this mode.\\n:param encoding: Open the file with this encoding when opening in text\\n    mode. This is ignored when opening in binary mode.\\n\\n.. versionchanged:: 3.1\\n    Added the ``encoding`` parameter.\", \u0027num_calls\u0027: 3, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::create_jinja_environment", "label": "create_jinja_environment", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::create_jinja_environment\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027create_jinja_environment\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 380, \u0027end_line\u0027: 418, \u0027docstring\u0027: \u0027Create the Jinja environment based on :attr:`jinja_options`\\nand the various Jinja-related methods of the app. Changing\\n:attr:`jinja_options` after this will have no effect. Also adds\\nFlask-related globals and filters to the environment.\\n\\n.. versionchanged:: 0.11\\n   ``Environment.auto_reload`` set in accordance with\\n   ``TEMPLATES_AUTO_RELOAD`` configuration option.\\n\\n.. versionadded:: 0.5\u0027, \u0027num_calls\u0027: 3, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::create_url_adapter", "label": "create_url_adapter", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::create_url_adapter\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027create_url_adapter\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 420, \u0027end_line\u0027: 471, \u0027docstring\u0027: \u0027Creates a URL adapter for the given request. The URL adapter\\nis created at a point where the request context is not yet set\\nup so the request is passed explicitly.\\n\\n.. versionchanged:: 3.1\\n    If :data:`SERVER_NAME` is set, it does not restrict requests to\\n    only that domain, for both ``subdomain_matching`` and\\n    ``host_matching``.\\n\\n.. versionchanged:: 1.0\\n    :data:`SERVER_NAME` no longer implicitly enables subdomain\\n    matching. Use :attr:`subdomain_matching` instead.\\n\\n.. versionchanged:: 0.9\\n   This can be called outside a request when the URL adapter is created\\n   for an application context.\\n\\n.. versionadded:: 0.6\u0027, \u0027num_calls\u0027: 3, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::raise_routing_exception", "label": "raise_routing_exception", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::raise_routing_exception\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027raise_routing_exception\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 473, \u0027end_line\u0027: 499, \u0027docstring\u0027: \"Intercept routing exceptions and possibly do something else.\\n\\nIn debug mode, intercept a routing redirect and replace it with\\nan error if the body will be discarded.\\n\\nWith modern Werkzeug this shouldn\u0027t occur, since it now uses a\\n308 status which tells the browser to resend the method and\\nbody.\\n\\n.. versionchanged:: 2.1\\n    Don\u0027t intercept 307 and 308 redirects.\\n\\n:meta private:\\n:internal:\", \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::update_template_context", "label": "update_template_context", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::update_template_context\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027update_template_context\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 501, \u0027end_line\u0027: 527, \u0027docstring\u0027: \u0027Update the template context with some commonly used variables.\\nThis injects request, session, config and g into the template\\ncontext as well as everything template context processors want\\nto inject.  Note that the as of Flask 0.6, the original values\\nin the context will not be overridden if a context processor\\ndecides to return a value with the same key.\\n\\n:param context: the context as a dictionary that is updated in place\\n                to add extra variables.\u0027, \u0027num_calls\u0027: 7, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::make_shell_context", "label": "make_shell_context", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::make_shell_context\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027make_shell_context\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 529, \u0027end_line\u0027: 539, \u0027docstring\u0027: \u0027Returns the shell context for an interactive shell for this\\napplication.  This runs all the registered shell context\\nprocessors.\\n\\n.. versionadded:: 0.11\u0027, \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::run", "label": "run", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::run\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027run\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 541, \u0027end_line\u0027: 662, \u0027docstring\u0027: \"Runs the application on a local development server.\\n\\nDo not use ``run()`` in a production setting. It is not intended to\\nmeet security and performance requirements for a production server.\\nInstead, see :doc:`/deploying/index` for WSGI server recommendations.\\n\\nIf the :attr:`debug` flag is set the server will automatically reload\\nfor code changes and show a debugger in case an exception happened.\\n\\nIf you want to run the application in debug mode, but disable the\\ncode execution on the interactive debugger, you can pass\\n``use_evalex=False`` as parameter.  This will keep the debugger\u0027s\\ntraceback screen active, but disable code execution.\\n\\nIt is not recommended to use this function for development with\\nautomatic reloading as this is badly supported.  Instead you should\\nbe using the :command:`flask` command line script\u0027s ``run`` support.\\n\\n.. admonition:: Keep in Mind\\n\\n   Flask will suppress any server error with a generic error page\\n   unless it is in debug mode.  As such to enable just the\\n   interactive debugger without the code reloading, you have to\\n   invoke :meth:`run` with ``debug=True`` and ``use_reloader=False``.\\n   Setting ``use_debugger`` to ``True`` without being in debug mode\\n   won\u0027t catch any exceptions because there won\u0027t be any to\\n   catch.\\n\\n:param host: the hostname to listen on. Set this to ``\u00270.0.0.0\u0027`` to\\n    have the server available externally as well. Defaults to\\n    ``\u0027127.0.0.1\u0027`` or the host in the ``SERVER_NAME`` config variable\\n    if present.\\n:param port: the port of the webserver. Defaults to ``5000`` or the\\n    port defined in the ``SERVER_NAME`` config variable if present.\\n:param debug: if given, enable or disable debug mode. See\\n    :attr:`debug`.\\n:param load_dotenv: Load the nearest :file:`.env` and :file:`.flaskenv`\\n    files to set environment variables. Will also change the working\\n    directory to the directory containing the first file found.\\n:param options: the options to be forwarded to the underlying Werkzeug\\n    server. See :func:`werkzeug.serving.run_simple` for more\\n    information.\\n\\n.. versionchanged:: 1.0\\n    If installed, python-dotenv will be used to load environment\\n    variables from :file:`.env` and :file:`.flaskenv` files.\\n\\n    The :envvar:`FLASK_DEBUG` environment variable will override :attr:`debug`.\\n\\n    Threaded mode is enabled by default.\\n\\n.. versionchanged:: 0.10\\n    The default port is now picked from the ``SERVER_NAME``\\n    variable.\", \u0027num_calls\u0027: 17, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::test_client", "label": "test_client", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::test_client\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027test_client\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 664, \u0027end_line\u0027: 720, \u0027docstring\u0027: \u0027Creates a test client for this application.  For information\\nabout unit testing head over to :doc:`/testing`.\\n\\nNote that if you are testing for assertions or exceptions in your\\napplication code, you must set ``app.testing = True`` in order for the\\nexceptions to propagate to the test client.  Otherwise, the exception\\nwill be handled by the application (not visible to the test client) and\\nthe only indication of an AssertionError or other exception will be a\\n500 status code response to the test client.  See the :attr:`testing`\\nattribute.  For example::\\n\\n    app.testing = True\\n    client = app.test_client()\\n\\nThe test client can be used in a ``with`` block to defer the closing down\\nof the context until the end of the ``with`` block.  This is useful if\\nyou want to access the context locals for testing::\\n\\n    with app.test_client() as c:\\n        rv = c.get(\\\u0027/?vodka=42\\\u0027)\\n        assert request.args[\\\u0027vodka\\\u0027] == \\\u002742\\\u0027\\n\\nAdditionally, you may pass optional keyword arguments that will then\\nbe passed to the application\\\u0027s :attr:`test_client_class` constructor.\\nFor example::\\n\\n    from flask.testing import FlaskClient\\n\\n    class CustomClient(FlaskClient):\\n        def __init__(self, *args, **kwargs):\\n            self._authentication = kwargs.pop(\"authentication\")\\n            super(CustomClient,self).__init__( *args, **kwargs)\\n\\n    app.test_client_class = CustomClient\\n    client = app.test_client(authentication=\\\u0027Basic ....\\\u0027)\\n\\nSee :class:`~flask.testing.FlaskClient` for more information.\\n\\n.. versionchanged:: 0.4\\n   added support for ``with`` block usage for the client.\\n\\n.. versionadded:: 0.7\\n   The `use_cookies` parameter was added as well as the ability\\n   to override the client to be used by setting the\\n   :attr:`test_client_class` attribute.\\n\\n.. versionchanged:: 0.11\\n   Added `**kwargs` to support passing additional keyword arguments to\\n   the constructor of :attr:`test_client_class`.\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::test_cli_runner", "label": "test_cli_runner", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::test_cli_runner\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027test_cli_runner\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 722, \u0027end_line\u0027: 737, \u0027docstring\u0027: \u0027Create a CLI runner for testing CLI commands.\\nSee :ref:`testing-cli`.\\n\\nReturns an instance of :attr:`test_cli_runner_class`, by default\\n:class:`~flask.testing.FlaskCliRunner`. The Flask app object is\\npassed as the first argument.\\n\\n.. versionadded:: 1.0\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::handle_http_exception", "label": "handle_http_exception", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::handle_http_exception\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027handle_http_exception\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 739, \u0027end_line\u0027: 772, \u0027docstring\u0027: \u0027Handles an HTTP exception.  By default this will invoke the\\nregistered error handlers and fall back to returning the\\nexception as response.\\n\\n.. versionchanged:: 1.0.3\\n    ``RoutingException``, used internally for actions such as\\n     slash redirects during routing, is not passed to error\\n     handlers.\\n\\n.. versionchanged:: 1.0\\n    Exceptions are looked up by code *and* by MRO, so\\n    ``HTTPException`` subclasses can be handled with a catch-all\\n    handler for the base ``HTTPException``.\\n\\n.. versionadded:: 0.3\u0027, \u0027num_calls\u0027: 3, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::handle_user_exception", "label": "handle_user_exception", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::handle_user_exception\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027handle_user_exception\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 774, \u0027end_line\u0027: 804, \u0027docstring\u0027: \u0027This method is called whenever an exception occurs that\\nshould be handled. A special case is :class:`~werkzeug\\n.exceptions.HTTPException` which is forwarded to the\\n:meth:`handle_http_exception` method. This function will either\\nreturn a response value or reraise the exception with the same\\ntraceback.\\n\\n.. versionchanged:: 1.0\\n    Key errors raised from request data like ``form`` show the\\n    bad key in debug mode rather than a generic bad request\\n    message.\\n\\n.. versionadded:: 0.7\u0027, \u0027num_calls\u0027: 6, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::handle_exception", "label": "handle_exception", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::handle_exception\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027handle_exception\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 806, \u0027end_line\u0027: 857, \u0027docstring\u0027: \u0027Handle an exception that did not have an error handler\\nassociated with it, or that was raised from an error handler.\\nThis always causes a 500 ``InternalServerError``.\\n\\nAlways sends the :data:`got_request_exception` signal.\\n\\nIf :data:`PROPAGATE_EXCEPTIONS` is ``True``, such as in debug\\nmode, the error will be re-raised so that the debugger can\\ndisplay it. Otherwise, the original exception is logged, and\\nan :exc:`~werkzeug.exceptions.InternalServerError` is returned.\\n\\nIf an error handler is registered for ``InternalServerError`` or\\n``500``, it will be used. For consistency, the handler will\\nalways receive the ``InternalServerError``. The original\\nunhandled exception is available as ``e.original_exception``.\\n\\n.. versionchanged:: 1.1.0\\n    Always passes the ``InternalServerError`` instance to the\\n    handler, setting ``original_exception`` to the unhandled\\n    error.\\n\\n.. versionchanged:: 1.1.0\\n    ``after_request`` functions and other finalization is done\\n    even for the default 500 response when there is no handler.\\n\\n.. versionadded:: 0.3\u0027, \u0027num_calls\u0027: 7, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::log_exception", "label": "log_exception", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::log_exception\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027log_exception\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 859, \u0027end_line\u0027: 872, \u0027docstring\u0027: \u0027Logs an exception.  This is called by :meth:`handle_exception`\\nif debugging is disabled and right before the handler is called.\\nThe default implementation logs the exception as error on the\\n:attr:`logger`.\\n\\n.. versionadded:: 0.8\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::dispatch_request", "label": "dispatch_request", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::dispatch_request\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027dispatch_request\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 874, \u0027end_line\u0027: 898, \u0027docstring\u0027: \u0027Does the request dispatching.  Matches the URL and returns the\\nreturn value of the view or error handler.  This does not have to\\nbe a response object.  In order to convert the return value to a\\nproper response object, call :func:`make_response`.\\n\\n.. versionchanged:: 0.7\\n   This no longer does the exception handling, this code was\\n   moved to the new :meth:`full_dispatch_request`.\u0027, \u0027num_calls\u0027: 5, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::full_dispatch_request", "label": "full_dispatch_request", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::full_dispatch_request\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027full_dispatch_request\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 900, \u0027end_line\u0027: 916, \u0027docstring\u0027: \u0027Dispatches the request and on top of that performs request\\npre and postprocessing as well as HTTP exception catching and\\nerror handling.\\n\\n.. versionadded:: 0.7\u0027, \u0027num_calls\u0027: 5, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::finalize_request", "label": "finalize_request", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::finalize_request\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027finalize_request\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 918, \u0027end_line\u0027: 947, \u0027docstring\u0027: \u0027Given the return value from a view function this finalizes\\nthe request by converting it into a response and invoking the\\npostprocessing functions.  This is invoked for both normal\\nrequest dispatching as well as error handlers.\\n\\nBecause this means that it might be called as a result of a\\nfailure a special safe mode is available which can be enabled\\nwith the `from_error_handler` flag.  If enabled, failures in\\nresponse processing will be logged and otherwise ignored.\\n\\n:internal:\u0027, \u0027num_calls\u0027: 4, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::make_default_options_response", "label": "make_default_options_response", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::make_default_options_response\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027make_default_options_response\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 949, \u0027end_line\u0027: 960, \u0027docstring\u0027: \u0027This method is called to create the default ``OPTIONS`` response.\\nThis can be changed through subclassing to change the default\\nbehavior of ``OPTIONS`` responses.\\n\\n.. versionadded:: 0.7\u0027, \u0027num_calls\u0027: 4, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::ensure_sync", "label": "ensure_sync", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::ensure_sync\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027ensure_sync\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 962, \u0027end_line\u0027: 974, \u0027docstring\u0027: \u0027Ensure that the function is synchronous for WSGI workers.\\nPlain ``def`` functions are returned as-is. ``async def``\\nfunctions are wrapped to run and wait for the response.\\n\\nOverride this method to change how the app runs async views.\\n\\n.. versionadded:: 2.0\u0027, \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::async_to_sync", "label": "async_to_sync", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::async_to_sync\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027async_to_sync\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 976, \u0027end_line\u0027: 997, \u0027docstring\u0027: \u0027Return a sync function that will run the coroutine function.\\n\\n.. code-block:: python\\n\\n    result = app.async_to_sync(func)(*args, **kwargs)\\n\\nOverride this method to change how the app converts async code\\nto be synchronously callable.\\n\\n.. versionadded:: 2.0\u0027, \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::url_for", "label": "url_for", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::url_for\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027url_for\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 999, \u0027end_line\u0027: 1119, \u0027docstring\u0027: \"Generate a URL to the given endpoint with the given values.\\n\\nThis is called by :func:`flask.url_for`, and can be called\\ndirectly as well.\\n\\nAn *endpoint* is the name of a URL rule, usually added with\\n:meth:`@app.route() \u003croute\u003e`, and usually the same name as the\\nview function. A route defined in a :class:`~flask.Blueprint`\\nwill prepend the blueprint\u0027s name separated by a ``.`` to the\\nendpoint.\\n\\nIn some cases, such as email messages, you want URLs to include\\nthe scheme and domain, like ``https://example.com/hello``. When\\nnot in an active request, URLs will be external by default, but\\nthis requires setting :data:`SERVER_NAME` so Flask knows what\\ndomain to use. :data:`APPLICATION_ROOT` and\\n:data:`PREFERRED_URL_SCHEME` should also be configured as\\nneeded. This config is only used when not in an active request.\\n\\nFunctions can be decorated with :meth:`url_defaults` to modify\\nkeyword arguments before the URL is built.\\n\\nIf building fails for some reason, such as an unknown endpoint\\nor incorrect values, the app\u0027s :meth:`handle_url_build_error`\\nmethod is called. If that returns a string, that is returned,\\notherwise a :exc:`~werkzeug.routing.BuildError` is raised.\\n\\n:param endpoint: The endpoint name associated with the URL to\\n    generate. If this starts with a ``.``, the current blueprint\\n    name (if any) will be used.\\n:param _anchor: If given, append this as ``#anchor`` to the URL.\\n:param _method: If given, generate the URL associated with this\\n    method for the endpoint.\\n:param _scheme: If given, the URL will have this scheme if it\\n    is external.\\n:param _external: If given, prefer the URL to be internal\\n    (False) or require it to be external (True). External URLs\\n    include the scheme and domain. When not in an active\\n    request, URLs are external by default.\\n:param values: Values to use for the variable parts of the URL\\n    rule. Unknown keys are appended as query string arguments,\\n    like ``?a=b\u0026c=d``.\\n\\n.. versionadded:: 2.2\\n    Moved from ``flask.url_for``, which calls this method.\", \u0027num_calls\u0027: 9, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::make_response", "label": "make_response", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::make_response\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027make_response\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 1121, \u0027end_line\u0027: 1261, \u0027docstring\u0027: \"Convert the return value from a view function to an instance of\\n:attr:`response_class`.\\n\\n:param rv: the return value from the view function. The view function\\n    must return a response. Returning ``None``, or the view ending\\n    without returning, is not allowed. The following types are allowed\\n    for ``view_rv``:\\n\\n    ``str``\\n        A response object is created with the string encoded to UTF-8\\n        as the body.\\n\\n    ``bytes``\\n        A response object is created with the bytes as the body.\\n\\n    ``dict``\\n        A dictionary that will be jsonify\u0027d before being returned.\\n\\n    ``list``\\n        A list that will be jsonify\u0027d before being returned.\\n\\n    ``generator`` or ``iterator``\\n        A generator that returns ``str`` or ``bytes`` to be\\n        streamed as the response.\\n\\n    ``tuple``\\n        Either ``(body, status, headers)``, ``(body, status)``, or\\n        ``(body, headers)``, where ``body`` is any of the other types\\n        allowed here, ``status`` is a string or an integer, and\\n        ``headers`` is a dictionary or a list of ``(key, value)``\\n        tuples. If ``body`` is a :attr:`response_class` instance,\\n        ``status`` overwrites the exiting value and ``headers`` are\\n        extended.\\n\\n    :attr:`response_class`\\n        The object is returned unchanged.\\n\\n    other :class:`~werkzeug.wrappers.Response` class\\n        The object is coerced to :attr:`response_class`.\\n\\n    :func:`callable`\\n        The function is called as a WSGI application. The result is\\n        used to create a response object.\\n\\n.. versionchanged:: 2.2\\n    A generator will be converted to a streaming response.\\n    A list will be converted to a JSON response.\\n\\n.. versionchanged:: 1.1\\n    A dict will be converted to a JSON response.\\n\\n.. versionchanged:: 0.9\\n   Previously a tuple was interpreted as the arguments for the\\n   response object.\", \u0027num_calls\u0027: 23, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::preprocess_request", "label": "preprocess_request", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::preprocess_request\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027preprocess_request\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 1263, \u0027end_line\u0027: 1289, \u0027docstring\u0027: \u0027Called before the request is dispatched. Calls\\n:attr:`url_value_preprocessors` registered with the app and the\\ncurrent blueprint (if any). Then calls :attr:`before_request_funcs`\\nregistered with the app and the blueprint.\\n\\nIf any :meth:`before_request` handler returns a non-None value, the\\nvalue is handled as if it was the return value from the view, and\\nfurther request handling is stopped.\u0027, \u0027num_calls\u0027: 4, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::process_response", "label": "process_response", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::process_response\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027process_response\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 1291, \u0027end_line\u0027: 1317, \u0027docstring\u0027: \"Can be overridden in order to modify the response object\\nbefore it\u0027s sent to the WSGI server.  By default this will\\ncall all the :meth:`after_request` decorated functions.\\n\\n.. versionchanged:: 0.5\\n   As of Flask 0.5 the functions registered for after request\\n   execution are called in reverse order of registration.\\n\\n:param response: a :attr:`response_class` object.\\n:return: a new response object or the same, has to be an\\n         instance of :attr:`response_class`.\", \u0027num_calls\u0027: 7, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::do_teardown_request", "label": "do_teardown_request", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::do_teardown_request\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027do_teardown_request\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 1319, \u0027end_line\u0027: 1341, \u0027docstring\u0027: \u0027Called after the request is dispatched and the response is finalized,\\nright before the request context is popped. Called by\\n:meth:`.AppContext.pop`.\\n\\nThis calls all functions decorated with :meth:`teardown_request`, and\\n:meth:`Blueprint.teardown_request` if a blueprint handled the request.\\nFinally, the :data:`request_tearing_down` signal is sent.\\n\\n:param exc: An unhandled exception raised while dispatching the request.\\n    Passed to each teardown function.\\n\\n.. versionchanged:: 0.9\\n    Added the ``exc`` argument.\u0027, \u0027num_calls\u0027: 5, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::do_teardown_appcontext", "label": "do_teardown_appcontext", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::do_teardown_appcontext\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027do_teardown_appcontext\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 1343, \u0027end_line\u0027: 1358, \u0027docstring\u0027: \u0027Called right before the application context is popped. Called by\\n:meth:`.AppContext.pop`.\\n\\nThis calls all functions decorated with :meth:`teardown_appcontext`.\\nThen the :data:`appcontext_tearing_down` signal is sent.\\n\\n:param exc: An unhandled exception raised while the context was active.\\n    Passed to each teardown function.\\n\\n.. versionadded:: 0.9\u0027, \u0027num_calls\u0027: 3, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::app_context", "label": "app_context", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::app_context\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027app_context\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 1360, \u0027end_line\u0027: 1378, \u0027docstring\u0027: \u0027Create an :class:`.AppContext`. When the context is pushed,\\n:data:`.current_app` and :data:`.g` become available.\\n\\nA context is automatically pushed when handling each request, and when\\nrunning any ``flask`` CLI command. Use this as a ``with`` block to\\nmanually push a context outside of those situations, such as during\\nsetup or testing.\\n\\n.. code-block:: python\\n\\n    with app.app_context():\\n        init_db()\\n\\nSee :doc:`/appcontext`.\\n\\n.. versionadded:: 0.9\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::request_context", "label": "request_context", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::request_context\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027request_context\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 1380, \u0027end_line\u0027: 1394, \u0027docstring\u0027: \u0027Create an :class:`.AppContext` with request information representing\\nthe given WSGI environment. A context is automatically pushed when\\nhandling each request. When the context is pushed, :data:`.request`,\\n:data:`.session`, :data:`g:, and :data:`.current_app` become available.\\n\\nThis method should not be used in your own code. Creating a valid WSGI\\nenviron is not trivial. Use :meth:`test_request_context` to correctly\\ncreate a WSGI environ and request context instead.\\n\\nSee :doc:`/appcontext`.\\n\\n:param environ: A WSGI environment.\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::test_request_context", "label": "test_request_context", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::test_request_context\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027test_request_context\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 1396, \u0027end_line\u0027: 1443, \u0027docstring\u0027: \"Create an :class:`.AppContext` with request information created from\\nthe given arguments. When the context is pushed, :data:`.request`,\\n:data:`.session`, :data:`g:, and :data:`.current_app` become available.\\n\\nThis is useful during testing to run a function that uses request data\\nwithout dispatching a full request. Use this as a ``with`` block to push\\na context.\\n\\n.. code-block:: python\\n\\n    with app.test_request_context(...):\\n        generate_report()\\n\\nSee :doc:`/appcontext`.\\n\\nTakes the same arguments as Werkzeug\u0027s\\n:class:`~werkzeug.test.EnvironBuilder`, with some defaults from\\nthe application. See the linked Werkzeug docs for most of the\\navailable arguments. Flask-specific behavior is listed here.\\n\\n:param path: URL path being requested.\\n:param base_url: Base URL where the app is being served, which\\n    ``path`` is relative to. If not given, built from\\n    :data:`PREFERRED_URL_SCHEME`, ``subdomain``, :data:`SERVER_NAME`,\\n    and :data:`APPLICATION_ROOT`.\\n:param subdomain: Subdomain name to prepend to :data:`SERVER_NAME`.\\n:param url_scheme: Scheme to use instead of\\n    :data:`PREFERRED_URL_SCHEME`.\\n:param data: The request body text or bytes,or a dict of form data.\\n:param json: If given, this is serialized as JSON and passed as\\n    ``data``. Also defaults ``content_type`` to\\n    ``application/json``.\\n:param args: Other positional arguments passed to\\n    :class:`~werkzeug.test.EnvironBuilder`.\\n:param kwargs: Other keyword arguments passed to\\n    :class:`~werkzeug.test.EnvironBuilder`.\", \u0027num_calls\u0027: 4, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::wsgi_app", "label": "wsgi_app", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::wsgi_app\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027wsgi_app\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 1445, \u0027end_line\u0027: 1491, \u0027docstring\u0027: \"The actual WSGI application. This is not implemented in\\n:meth:`__call__` so that middlewares can be applied without\\nlosing a reference to the app object. Instead of doing this::\\n\\n    app = MyMiddleware(app)\\n\\nIt\u0027s a better idea to do this instead::\\n\\n    app.wsgi_app = MyMiddleware(app.wsgi_app)\\n\\nThen you still have the original application object around and\\ncan continue to call methods on it.\\n\\n.. versionchanged:: 0.7\\n    Teardown events for the request and app contexts are called\\n    even if an unhandled error occurs. Other events may not be\\n    called depending on when an error occurs during dispatch.\\n\\n:param environ: A WSGI environment.\\n:param start_response: A callable accepting a status code,\\n    a list of headers, and an optional exception context to\\n    start the response.\", \u0027num_calls\u0027: 9, \u0027decorators\u0027: []}"}, {"color": "#ff6666", "id": "test:src.flask.app::__call__", "label": "__call__", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Test\u0027, \u0027symbol_id\u0027: \u0027src.flask.app::__call__\u0027, \u0027module\u0027: \u0027src.flask.app\u0027, \u0027name\u0027: \u0027__call__\u0027, \u0027path\u0027: \u0027src/flask/app.py\u0027, \u0027start_line\u0027: 1493, \u0027end_line\u0027: 1500, \u0027docstring\u0027: \u0027The WSGI server calls the Flask application object as the\\nWSGI application. This calls :meth:`wsgi_app`, which can be\\nwrapped to apply middleware.\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.debughelpers::UnexpectedUnicodeError", "label": "UnexpectedUnicodeError", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.debughelpers::UnexpectedUnicodeError\u0027, \u0027module\u0027: \u0027src.flask.debughelpers\u0027, \u0027name\u0027: \u0027UnexpectedUnicodeError\u0027, \u0027path\u0027: \u0027src/flask/debughelpers.py\u0027, \u0027start_line\u0027: 17, \u0027end_line\u0027: 20, \u0027docstring\u0027: \u0027Raised in places where we want some better error reporting for\\nunexpected unicode or binary data.\u0027, \u0027num_calls\u0027: 0, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.debughelpers::DebugFilesKeyError", "label": "DebugFilesKeyError", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.debughelpers::DebugFilesKeyError\u0027, \u0027module\u0027: \u0027src.flask.debughelpers\u0027, \u0027name\u0027: \u0027DebugFilesKeyError\u0027, \u0027path\u0027: \u0027src/flask/debughelpers.py\u0027, \u0027start_line\u0027: 23, \u0027end_line\u0027: 47, \u0027docstring\u0027: \u0027Raised from request.files during debugging.  The idea is that it can\\nprovide a better error message than just a generic KeyError/BadRequest.\u0027, \u0027num_calls\u0027: 5, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.debughelpers::FormDataRoutingRedirect", "label": "FormDataRoutingRedirect", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.debughelpers::FormDataRoutingRedirect\u0027, \u0027module\u0027: \u0027src.flask.debughelpers\u0027, \u0027name\u0027: \u0027FormDataRoutingRedirect\u0027, \u0027path\u0027: \u0027src/flask/debughelpers.py\u0027, \u0027start_line\u0027: 50, \u0027end_line\u0027: 78, \u0027docstring\u0027: \u0027This exception is raised in debug mode if a routing redirect\\nwould cause the browser to drop the method or body. This happens\\nwhen method is not GET, HEAD or OPTIONS and the status code is not\\n307 or 308.\u0027, \u0027num_calls\u0027: 7, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.debughelpers::attach_enctype_error_multidict", "label": "attach_enctype_error_multidict", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.debughelpers::attach_enctype_error_multidict\u0027, \u0027module\u0027: \u0027src.flask.debughelpers\u0027, \u0027name\u0027: \u0027attach_enctype_error_multidict\u0027, \u0027path\u0027: \u0027src/flask/debughelpers.py\u0027, \u0027start_line\u0027: 81, \u0027end_line\u0027: 104, \u0027docstring\u0027: \u0027Patch ``request.files.__getitem__`` to raise a descriptive error\\nabout ``enctype=multipart/form-data``.\\n\\n:param request: The request to patch.\\n:meta private:\u0027, \u0027num_calls\u0027: 4, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.debughelpers::_dump_loader_info", "label": "_dump_loader_info", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.debughelpers::_dump_loader_info\u0027, \u0027module\u0027: \u0027src.flask.debughelpers\u0027, \u0027name\u0027: \u0027_dump_loader_info\u0027, \u0027path\u0027: \u0027src/flask/debughelpers.py\u0027, \u0027start_line\u0027: 107, \u0027end_line\u0027: 121, \u0027docstring\u0027: None, \u0027num_calls\u0027: 9, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.debughelpers::explain_template_loading_attempts", "label": "explain_template_loading_attempts", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.debughelpers::explain_template_loading_attempts\u0027, \u0027module\u0027: \u0027src.flask.debughelpers\u0027, \u0027name\u0027: \u0027explain_template_loading_attempts\u0027, \u0027path\u0027: \u0027src/flask/debughelpers.py\u0027, \u0027start_line\u0027: 124, \u0027end_line\u0027: 179, \u0027docstring\u0027: \u0027This should help developers understand what failed\u0027, \u0027num_calls\u0027: 16, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.debughelpers::__init__", "label": "__init__", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.debughelpers::__init__\u0027, \u0027module\u0027: \u0027src.flask.debughelpers\u0027, \u0027name\u0027: \u0027__init__\u0027, \u0027path\u0027: \u0027src/flask/debughelpers.py\u0027, \u0027start_line\u0027: 57, \u0027end_line\u0027: 78, \u0027docstring\u0027: None, \u0027num_calls\u0027: 7, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.debughelpers::__str__", "label": "__str__", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.debughelpers::__str__\u0027, \u0027module\u0027: \u0027src.flask.debughelpers\u0027, \u0027name\u0027: \u0027__str__\u0027, \u0027path\u0027: \u0027src/flask/debughelpers.py\u0027, \u0027start_line\u0027: 46, \u0027end_line\u0027: 47, \u0027docstring\u0027: None, \u0027num_calls\u0027: 0, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.debughelpers::newcls", "label": "newcls", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.debughelpers::newcls\u0027, \u0027module\u0027: \u0027src.flask.debughelpers\u0027, \u0027name\u0027: \u0027newcls\u0027, \u0027path\u0027: \u0027src/flask/debughelpers.py\u0027, \u0027start_line\u0027: 90, \u0027end_line\u0027: 100, \u0027docstring\u0027: None, \u0027num_calls\u0027: 4, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.debughelpers::__getitem__", "label": "__getitem__", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.debughelpers::__getitem__\u0027, \u0027module\u0027: \u0027src.flask.debughelpers\u0027, \u0027name\u0027: \u0027__getitem__\u0027, \u0027path\u0027: \u0027src/flask/debughelpers.py\u0027, \u0027start_line\u0027: 91, \u0027end_line\u0027: 100, \u0027docstring\u0027: None, \u0027num_calls\u0027: 4, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.views::View", "label": "View", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.views::View\u0027, \u0027module\u0027: \u0027src.flask.views\u0027, \u0027name\u0027: \u0027View\u0027, \u0027path\u0027: \u0027src/flask/views.py\u0027, \u0027start_line\u0027: 16, \u0027end_line\u0027: 135, \u0027docstring\u0027: \u0027Subclass this class and override :meth:`dispatch_request` to\\ncreate a generic class-based view. Call :meth:`as_view` to create a\\nview function that creates an instance of the class with the given\\narguments and calls its ``dispatch_request`` method with any URL\\nvariables.\\n\\nSee :doc:`views` for a detailed guide.\\n\\n.. code-block:: python\\n\\n    class Hello(View):\\n        init_every_request = False\\n\\n        def dispatch_request(self, name):\\n            return f\"Hello, {name}!\"\\n\\n    app.add_url_rule(\\n        \"/hello/\u003cname\u003e\", view_func=Hello.as_view(\"hello\")\\n    )\\n\\nSet :attr:`methods` on the class to change what methods the view\\naccepts.\\n\\nSet :attr:`decorators` on the class to apply a list of decorators to\\nthe generated view function. Decorators applied to the class itself\\nwill not be applied to the generated view function!\\n\\nSet :attr:`init_every_request` to ``False`` for efficiency, unless\\nyou need to store request-global data on ``self``.\u0027, \u0027num_calls\u0027: 6, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.views::MethodView", "label": "MethodView", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.views::MethodView\u0027, \u0027module\u0027: \u0027src.flask.views\u0027, \u0027name\u0027: \u0027MethodView\u0027, \u0027path\u0027: \u0027src/flask/views.py\u0027, \u0027start_line\u0027: 138, \u0027end_line\u0027: 191, \u0027docstring\u0027: \u0027Dispatches request methods to the corresponding instance methods.\\nFor example, if you implement a ``get`` method, it will be used to\\nhandle ``GET`` requests.\\n\\nThis can be useful for defining a REST API.\\n\\n:attr:`methods` is automatically set based on the methods defined on\\nthe class.\\n\\nSee :doc:`views` for a detailed guide.\\n\\n.. code-block:: python\\n\\n    class CounterAPI(MethodView):\\n        def get(self):\\n            return str(session.get(\"counter\", 0))\\n\\n        def post(self):\\n            session[\"counter\"] = session.get(\"counter\", 0) + 1\\n            return redirect(url_for(\"counter\"))\\n\\n    app.add_url_rule(\\n        \"/counter\", view_func=CounterAPI.as_view(\"counter\")\\n    )\u0027, \u0027num_calls\u0027: 12, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.views::dispatch_request", "label": "dispatch_request", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.views::dispatch_request\u0027, \u0027module\u0027: \u0027src.flask.views\u0027, \u00
