27name\u0027: \u0027dispatch_request\u0027, \u0027path\u0027: \u0027src/flask/views.py\u0027, \u0027start_line\u0027: 182, \u0027end_line\u0027: 191, \u0027docstring\u0027: None, \u0027num_calls\u0027: 4, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.views::as_view", "label": "as_view", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.views::as_view\u0027, \u0027module\u0027: \u0027src.flask.views\u0027, \u0027name\u0027: \u0027as_view\u0027, \u0027path\u0027: \u0027src/flask/views.py\u0027, \u0027start_line\u0027: 86, \u0027end_line\u0027: 135, \u0027docstring\u0027: \u0027Convert the class into a view function that can be registered\\nfor a route.\\n\\nBy default, the generated view will create a new instance of the\\nview class for every request and call its\\n:meth:`dispatch_request` method. If the view class sets\\n:attr:`init_every_request` to ``False``, the same instance will\\nbe used for every request.\\n\\nExcept for ``name``, all other arguments passed to this method\\nare forwarded to the view class ``__init__`` method.\\n\\n.. versionchanged:: 2.2\\n    Added the ``init_every_request`` class attribute.\u0027, \u0027num_calls\u0027: 5, \u0027decorators\u0027: [\u0027classmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.views::__init_subclass__", "label": "__init_subclass__", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.views::__init_subclass__\u0027, \u0027module\u0027: \u0027src.flask.views\u0027, \u0027name\u0027: \u0027__init_subclass__\u0027, \u0027path\u0027: \u0027src/flask/views.py\u0027, \u0027start_line\u0027: 165, \u0027end_line\u0027: 180, \u0027docstring\u0027: None, \u0027num_calls\u0027: 8, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.views::view", "label": "view", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.views::view\u0027, \u0027module\u0027: \u0027src.flask.views\u0027, \u0027name\u0027: \u0027view\u0027, \u0027path\u0027: \u0027src/flask/views.py\u0027, \u0027start_line\u0027: 115, \u0027end_line\u0027: 116, \u0027docstring\u0027: None, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.blueprints::Blueprint", "label": "Blueprint", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.blueprints::Blueprint\u0027, \u0027module\u0027: \u0027src.flask.blueprints\u0027, \u0027name\u0027: \u0027Blueprint\u0027, \u0027path\u0027: \u0027src/flask/blueprints.py\u0027, \u0027start_line\u0027: 18, \u0027end_line\u0027: 128, \u0027docstring\u0027: None, \u0027num_calls\u0027: 14, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.blueprints::__init__", "label": "__init__", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.blueprints::__init__\u0027, \u0027module\u0027: \u0027src.flask.blueprints\u0027, \u0027name\u0027: \u0027__init__\u0027, \u0027path\u0027: \u0027src/flask/blueprints.py\u0027, \u0027start_line\u0027: 19, \u0027end_line\u0027: 53, \u0027docstring\u0027: None, \u0027num_calls\u0027: 3, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.blueprints::get_send_file_max_age", "label": "get_send_file_max_age", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.blueprints::get_send_file_max_age\u0027, \u0027module\u0027: \u0027src.flask.blueprints\u0027, \u0027name\u0027: \u0027get_send_file_max_age\u0027, \u0027path\u0027: \u0027src/flask/blueprints.py\u0027, \u0027start_line\u0027: 55, \u0027end_line\u0027: 80, \u0027docstring\u0027: \"Used by :func:`send_file` to determine the ``max_age`` cache\\nvalue for a given file path if it wasn\u0027t passed.\\n\\nBy default, this returns :data:`SEND_FILE_MAX_AGE_DEFAULT` from\\nthe configuration of :data:`~flask.current_app`. This defaults\\nto ``None``, which tells the browser to use conditional requests\\ninstead of a timed cache, which is usually preferable.\\n\\nNote this is a duplicate of the same method in the Flask\\nclass.\\n\\n.. versionchanged:: 2.0\\n    The default configuration is ``None`` instead of 12 hours.\\n\\n.. versionadded:: 0.9\", \u0027num_calls\u0027: 3, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.blueprints::send_static_file", "label": "send_static_file", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.blueprints::send_static_file\u0027, \u0027module\u0027: \u0027src.flask.blueprints\u0027, \u0027name\u0027: \u0027send_static_file\u0027, \u0027path\u0027: \u0027src/flask/blueprints.py\u0027, \u0027start_line\u0027: 82, \u0027end_line\u0027: 102, \u0027docstring\u0027: \u0027The view function used to serve files from\\n:attr:`static_folder`. A route is automatically registered for\\nthis view at :attr:`static_url_path` if :attr:`static_folder` is\\nset.\\n\\nNote this is a duplicate of the same method in the Flask\\nclass.\\n\\n.. versionadded:: 0.5\u0027, \u0027num_calls\u0027: 4, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.blueprints::open_resource", "label": "open_resource", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.blueprints::open_resource\u0027, \u0027module\u0027: \u0027src.flask.blueprints\u0027, \u0027name\u0027: \u0027open_resource\u0027, \u0027path\u0027: \u0027src/flask/blueprints.py\u0027, \u0027start_line\u0027: 104, \u0027end_line\u0027: 128, \u0027docstring\u0027: \u0027Open a resource file relative to :attr:`root_path` for reading. The\\nblueprint-relative equivalent of the app\\\u0027s :meth:`~.Flask.open_resource`\\nmethod.\\n\\n:param resource: Path to the resource relative to :attr:`root_path`.\\n:param mode: Open the file in this mode. Only reading is supported,\\n    valid values are ``\"r\"`` (or ``\"rt\"``) and ``\"rb\"``.\\n:param encoding: Open the file with this encoding when opening in text\\n    mode. This is ignored when opening in binary mode.\\n\\n.. versionchanged:: 3.1\\n    Added the ``encoding`` parameter.\u0027, \u0027num_calls\u0027: 4, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.globals::__getattr__", "label": "__getattr__", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.globals::__getattr__\u0027, \u0027module\u0027: \u0027src.flask.globals\u0027, \u0027name\u0027: \u0027__getattr__\u0027, \u0027path\u0027: \u0027src/flask/globals.py\u0027, \u0027start_line\u0027: 65, \u0027end_line\u0027: 77, \u0027docstring\u0027: None, \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.globals::ProxyMixin", "label": "ProxyMixin", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.globals::ProxyMixin\u0027, \u0027module\u0027: \u0027src.flask.globals\u0027, \u0027name\u0027: \u0027ProxyMixin\u0027, \u0027path\u0027: \u0027src/flask/globals.py\u0027, \u0027start_line\u0027: 17, \u0027end_line\u0027: 18, \u0027docstring\u0027: None, \u0027num_calls\u0027: 0, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.globals::FlaskProxy", "label": "FlaskProxy", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.globals::FlaskProxy\u0027, \u0027module\u0027: \u0027src.flask.globals\u0027, \u0027name\u0027: \u0027FlaskProxy\u0027, \u0027path\u0027: \u0027src/flask/globals.py\u0027, \u0027start_line\u0027: 22, \u0027end_line\u0027: 22, \u0027docstring\u0027: None, \u0027num_calls\u0027: 0, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.globals::AppContextProxy", "label": "AppContextProxy", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.globals::AppContextProxy\u0027, \u0027module\u0027: \u0027src.flask.globals\u0027, \u0027name\u0027: \u0027AppContextProxy\u0027, \u0027path\u0027: \u0027src/flask/globals.py\u0027, \u0027start_line\u0027: 24, \u0027end_line\u0027: 24, \u0027docstring\u0027: None, \u0027num_calls\u0027: 0, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.globals::_AppCtxGlobalsProxy", "label": "_AppCtxGlobalsProxy", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.globals::_AppCtxGlobalsProxy\u0027, \u0027module\u0027: \u0027src.flask.globals\u0027, \u0027name\u0027: \u0027_AppCtxGlobalsProxy\u0027, \u0027path\u0027: \u0027src/flask/globals.py\u0027, \u0027start_line\u0027: 26, \u0027end_line\u0027: 26, \u0027docstring\u0027: None, \u0027num_calls\u0027: 0, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.globals::RequestProxy", "label": "RequestProxy", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.globals::RequestProxy\u0027, \u0027module\u0027: \u0027src.flask.globals\u0027, \u0027name\u0027: \u0027RequestProxy\u0027, \u0027path\u0027: \u0027src/flask/globals.py\u0027, \u0027start_line\u0027: 28, \u0027end_line\u0027: 28, \u0027docstring\u0027: None, \u0027num_calls\u0027: 0, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.globals::SessionMixinProxy", "label": "SessionMixinProxy", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.globals::SessionMixinProxy\u0027, \u0027module\u0027: \u0027src.flask.globals\u0027, \u0027name\u0027: \u0027SessionMixinProxy\u0027, \u0027path\u0027: \u0027src/flask/globals.py\u0027, \u0027start_line\u0027: 30, \u0027end_line\u0027: 30, \u0027docstring\u0027: None, \u0027num_calls\u0027: 0, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.globals::_get_current_object", "label": "_get_current_object", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.globals::_get_current_object\u0027, \u0027module\u0027: \u0027src.flask.globals\u0027, \u0027name\u0027: \u0027_get_current_object\u0027, \u0027path\u0027: \u0027src/flask/globals.py\u0027, \u0027start_line\u0027: 18, \u0027end_line\u0027: 18, \u0027docstring\u0027: None, \u0027num_calls\u0027: 0, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.config::ConfigAttribute", "label": "ConfigAttribute", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.config::ConfigAttribute\u0027, \u0027module\u0027: \u0027src.flask.config\u0027, \u0027name\u0027: \u0027ConfigAttribute\u0027, \u0027path\u0027: \u0027src/flask/config.py\u0027, \u0027start_line\u0027: 20, \u0027end_line\u0027: 47, \u0027docstring\u0027: \u0027Makes an attribute forward to the config\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.config::Config", "label": "Config", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.config::Config\u0027, \u0027module\u0027: \u0027src.flask.config\u0027, \u0027name\u0027: \u0027Config\u0027, \u0027path\u0027: \u0027src/flask/config.py\u0027, \u0027start_line\u0027: 50, \u0027end_line\u0027: 367, \u0027docstring\u0027: \"Works exactly like a dict but provides ways to fill it from files\\nor special dictionaries.  There are two common patterns to populate the\\nconfig.\\n\\nEither you can fill the config from a config file::\\n\\n    app.config.from_pyfile(\u0027yourconfig.cfg\u0027)\\n\\nOr alternatively you can define the configuration options in the\\nmodule that calls :meth:`from_object` or provide an import path to\\na module that should be loaded.  It is also possible to tell it to\\nuse the same module and with that provide the configuration values\\njust before the call::\\n\\n    DEBUG = True\\n    SECRET_KEY = \u0027development key\u0027\\n    app.config.from_object(__name__)\\n\\nIn both cases (loading from any Python file or loading from modules),\\nonly uppercase keys are added to the config.  This makes it possible to use\\nlowercase values in the config file for temporary values that are not added\\nto the config or to define the config keys in the same file that implements\\nthe application.\\n\\nProbably the most interesting way to load configurations is from an\\nenvironment variable pointing to a file::\\n\\n    app.config.from_envvar(\u0027YOURAPPLICATION_SETTINGS\u0027)\\n\\nIn this case before launching the application you have to set this\\nenvironment variable to the file you want to use.  On Linux and OS X\\nuse the export statement::\\n\\n    export YOURAPPLICATION_SETTINGS=\u0027/path/to/config/file\u0027\\n\\nOn windows use `set` instead.\\n\\n:param root_path: path to which files are read relative from.  When the\\n                  config object is created by the application, this is\\n                  the application\u0027s :attr:`~flask.Flask.root_path`.\\n:param defaults: an optional dictionary of default values\", \u0027num_calls\u0027: 36, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.config::__init__", "label": "__init__", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.config::__init__\u0027, \u0027module\u0027: \u0027src.flask.config\u0027, \u0027name\u0027: \u0027__init__\u0027, \u0027path\u0027: \u0027src/flask/config.py\u0027, \u0027start_line\u0027: 94, \u0027end_line\u0027: 100, \u0027docstring\u0027: None, \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.config::__get__", "label": "__get__", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.config::__get__\u0027, \u0027module\u0027: \u0027src.flask.config\u0027, \u0027name\u0027: \u0027__get__\u0027, \u0027path\u0027: \u0027src/flask/config.py\u0027, \u0027start_line\u0027: 35, \u0027end_line\u0027: 44, \u0027docstring\u0027: None, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.config::__set__", "label": "__set__", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.config::__set__\u0027, \u0027module\u0027: \u0027src.flask.config\u0027, \u0027name\u0027: \u0027__set__\u0027, \u0027path\u0027: \u0027src/flask/config.py\u0027, \u0027start_line\u0027: 46, \u0027end_line\u0027: 47, \u0027docstring\u0027: None, \u0027num_calls\u0027: 0, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.config::from_envvar", "label": "from_envvar", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.config::from_envvar\u0027, \u0027module\u0027: \u0027src.flask.config\u0027, \u0027name\u0027: \u0027from_envvar\u0027, \u0027path\u0027: \u0027src/flask/config.py\u0027, \u0027start_line\u0027: 102, \u0027end_line\u0027: 124, \u0027docstring\u0027: \"Loads a configuration from an environment variable pointing to\\na configuration file.  This is basically just a shortcut with nicer\\nerror messages for this line of code::\\n\\n    app.config.from_pyfile(os.environ[\u0027YOURAPPLICATION_SETTINGS\u0027])\\n\\n:param variable_name: name of the environment variable\\n:param silent: set to ``True`` if you want silent failure for missing\\n               files.\\n:return: ``True`` if the file was loaded successfully.\", \u0027num_calls\u0027: 3, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.config::from_prefixed_env", "label": "from_prefixed_env", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.config::from_prefixed_env\u0027, \u0027module\u0027: \u0027src.flask.config\u0027, \u0027name\u0027: \u0027from_prefixed_env\u0027, \u0027path\u0027: \u0027src/flask/config.py\u0027, \u0027start_line\u0027: 126, \u0027end_line\u0027: 185, \u0027docstring\u0027: \"Load any environment variables that start with ``FLASK_``,\\ndropping the prefix from the env key for the config key. Values\\nare passed through a loading function to attempt to convert them\\nto more specific types than strings.\\n\\nKeys are loaded in :func:`sorted` order.\\n\\nThe default loading function attempts to parse values as any\\nvalid JSON type, including dicts and lists.\\n\\nSpecific items in nested dicts can be set by separating the\\nkeys with double underscores (``__``). If an intermediate key\\ndoesn\u0027t exist, it will be initialized to an empty dict.\\n\\n:param prefix: Load env vars that start with this prefix,\\n    separated with an underscore (``_``).\\n:param loads: Pass each string value to this function and use\\n    the returned value as the config value. If any error is\\n    raised it is ignored and the value remains a string. The\\n    default is :func:`json.loads`.\\n\\n.. versionadded:: 2.1\", \u0027num_calls\u0027: 5, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.config::from_pyfile", "label": "from_pyfile", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.config::from_pyfile\u0027, \u0027module\u0027: \u0027src.flask.config\u0027, \u0027name\u0027: \u0027from_pyfile\u0027, \u0027path\u0027: \u0027src/flask/config.py\u0027, \u0027start_line\u0027: 187, \u0027end_line\u0027: 216, \u0027docstring\u0027: \u0027Updates the values in the config from a Python file.  This function\\nbehaves as if the file was imported as module with the\\n:meth:`from_object` function.\\n\\n:param filename: the filename of the config.  This can either be an\\n                 absolute filename or a filename relative to the\\n                 root path.\\n:param silent: set to ``True`` if you want silent failure for missing\\n               files.\\n:return: ``True`` if the file was loaded successfully.\\n\\n.. versionadded:: 0.7\\n   `silent` parameter.\u0027, \u0027num_calls\u0027: 7, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.config::from_object", "label": "from_object", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.config::from_object\u0027, \u0027module\u0027: \u0027src.flask.config\u0027, \u0027name\u0027: \u0027from_object\u0027, \u0027path\u0027: \u0027src/flask/config.py\u0027, \u0027start_line\u0027: 218, \u0027end_line\u0027: 254, \u0027docstring\u0027: \"Updates the values from the given object.  An object can be of one\\nof the following two types:\\n\\n-   a string: in this case the object with that name will be imported\\n-   an actual object reference: that object is used directly\\n\\nObjects are usually either modules or classes. :meth:`from_object`\\nloads only the uppercase attributes of the module/class. A ``dict``\\nobject will not work with :meth:`from_object` because the keys of a\\n``dict`` are not attributes of the ``dict`` class.\\n\\nExample of module-based configuration::\\n\\n    app.config.from_object(\u0027yourapplication.default_config\u0027)\\n    from yourapplication import default_config\\n    app.config.from_object(default_config)\\n\\nNothing is done to the object before loading. If the object is a\\nclass and has ``@property`` attributes, it needs to be\\ninstantiated before being passed to this method.\\n\\nYou should not use this function to load the actual configuration but\\nrather configuration defaults.  The actual config should be loaded\\nwith :meth:`from_pyfile` and ideally from a location not within the\\npackage because the package might be installed system wide.\\n\\nSee :ref:`config-dev-prod` for an example of class-based configuration\\nusing :meth:`from_object`.\\n\\n:param obj: an import name or object\", \u0027num_calls\u0027: 5, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.config::from_file", "label": "from_file", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.config::from_file\u0027, \u0027module\u0027: \u0027src.flask.config\u0027, \u0027name\u0027: \u0027from_file\u0027, \u0027path\u0027: \u0027src/flask/config.py\u0027, \u0027start_line\u0027: 256, \u0027end_line\u0027: 302, \u0027docstring\u0027: \u0027Update the values in the config from a file that is loaded\\nusing the ``load`` parameter. The loaded data is passed to the\\n:meth:`from_mapping` method.\\n\\n.. code-block:: python\\n\\n    import json\\n    app.config.from_file(\"config.json\", load=json.load)\\n\\n    import tomllib\\n    app.config.from_file(\"config.toml\", load=tomllib.load, text=False)\\n\\n:param filename: The path to the data file. This can be an\\n    absolute path or relative to the config root path.\\n:param load: A callable that takes a file handle and returns a\\n    mapping of loaded data from the file.\\n:type load: ``Callable[[Reader], Mapping]`` where ``Reader``\\n    implements a ``read`` method.\\n:param silent: Ignore the file if it doesn\\\u0027t exist.\\n:param text: Open the file in text or binary mode.\\n:return: ``True`` if the file was loaded successfully.\\n\\n.. versionchanged:: 2.3\\n    The ``text`` parameter was added.\\n\\n.. versionadded:: 2.0\u0027, \u0027num_calls\u0027: 4, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.config::from_mapping", "label": "from_mapping", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.config::from_mapping\u0027, \u0027module\u0027: \u0027src.flask.config\u0027, \u0027name\u0027: \u0027from_mapping\u0027, \u0027path\u0027: \u0027src/flask/config.py\u0027, \u0027start_line\u0027: 304, \u0027end_line\u0027: 321, \u0027docstring\u0027: \u0027Updates the config like :meth:`update` ignoring items with\\nnon-upper keys.\\n\\n:return: Always returns ``True``.\\n\\n.. versionadded:: 0.11\u0027, \u0027num_calls\u0027: 4, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.config::get_namespace", "label": "get_namespace", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.config::get_namespace\u0027, \u0027module\u0027: \u0027src.flask.config\u0027, \u0027name\u0027: \u0027get_namespace\u0027, \u0027path\u0027: \u0027src/flask/config.py\u0027, \u0027start_line\u0027: 323, \u0027end_line\u0027: 364, \u0027docstring\u0027: \"Returns a dictionary containing a subset of configuration options\\nthat match the specified namespace/prefix. Example usage::\\n\\n    app.config[\u0027IMAGE_STORE_TYPE\u0027] = \u0027fs\u0027\\n    app.config[\u0027IMAGE_STORE_PATH\u0027] = \u0027/var/app/images\u0027\\n    app.config[\u0027IMAGE_STORE_BASE_URL\u0027] = \u0027http://img.website.com\u0027\\n    image_store_config = app.config.get_namespace(\u0027IMAGE_STORE_\u0027)\\n\\nThe resulting dictionary `image_store_config` would look like::\\n\\n    {\\n        \u0027type\u0027: \u0027fs\u0027,\\n        \u0027path\u0027: \u0027/var/app/images\u0027,\\n        \u0027base_url\u0027: \u0027http://img.website.com\u0027\\n    }\\n\\nThis is often useful when configuration options map directly to\\nkeyword arguments in functions or class constructors.\\n\\n:param namespace: a configuration namespace\\n:param lowercase: a flag indicating if the keys of the resulting\\n                  dictionary should be lowercase\\n:param trim_namespace: a flag indicating if the keys of the resulting\\n                  dictionary should not include the namespace\\n\\n.. versionadded:: 0.11\", \u0027num_calls\u0027: 4, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.config::__repr__", "label": "__repr__", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.config::__repr__\u0027, \u0027module\u0027: \u0027src.flask.config\u0027, \u0027name\u0027: \u0027__repr__\u0027, \u0027path\u0027: \u0027src/flask/config.py\u0027, \u0027start_line\u0027: 366, \u0027end_line\u0027: 367, \u0027docstring\u0027: None, \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.wrappers::Request", "label": "Request", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.wrappers::Request\u0027, \u0027module\u0027: \u0027src.flask.wrappers\u0027, \u0027name\u0027: \u0027Request\u0027, \u0027path\u0027: \u0027src/flask/wrappers.py\u0027, \u0027start_line\u0027: 18, \u0027end_line\u0027: 219, \u0027docstring\u0027: \u0027The request object used by default in Flask.  Remembers the\\nmatched endpoint and view arguments.\\n\\nIt is what ends up as :class:`~flask.request`.  If you want to replace\\nthe request object used you can subclass this and set\\n:attr:`~flask.Flask.request_class` to your subclass.\\n\\nThe request object is a :class:`~werkzeug.wrappers.Request` subclass and\\nprovides all of the attributes Werkzeug defines plus a few Flask\\nspecific ones.\u0027, \u0027num_calls\u0027: 11, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.wrappers::Response", "label": "Response", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.wrappers::Response\u0027, \u0027module\u0027: \u0027src.flask.wrappers\u0027, \u0027name\u0027: \u0027Response\u0027, \u0027path\u0027: \u0027src/flask/wrappers.py\u0027, \u0027start_line\u0027: 222, \u0027end_line\u0027: 257, \u0027docstring\u0027: \"The response object that is used by default in Flask.  Works like the\\nresponse object from Werkzeug but is set to have an HTML mimetype by\\ndefault.  Quite often you don\u0027t have to create this object yourself because\\n:meth:`~flask.Flask.make_response` will take care of that for you.\\n\\nIf you want to replace the response object used you can subclass this and\\nset :attr:`~flask.Flask.response_class` to your subclass.\\n\\n.. versionchanged:: 1.0\\n    JSON support is added to the response, like the request. This is useful\\n    when testing to get the test client response data as JSON.\\n\\n.. versionchanged:: 1.0\\n\\n    Added :attr:`max_cookie_size`.\", \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.wrappers::max_content_length", "label": "max_content_length", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.wrappers::max_content_length\u0027, \u0027module\u0027: \u0027src.flask.wrappers\u0027, \u0027name\u0027: \u0027max_content_length\u0027, \u0027path\u0027: \u0027src/flask/wrappers.py\u0027, \u0027start_line\u0027: 89, \u0027end_line\u0027: 90, \u0027docstring\u0027: None, \u0027num_calls\u0027: 0, \u0027decorators\u0027: [\u0027setter\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.wrappers::max_form_memory_size", "label": "max_form_memory_size", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.wrappers::max_form_memory_size\u0027, \u0027module\u0027: \u0027src.flask.wrappers\u0027, \u0027name\u0027: \u0027max_form_memory_size\u0027, \u0027path\u0027: \u0027src/flask/wrappers.py\u0027, \u0027start_line\u0027: 116, \u0027end_line\u0027: 117, \u0027docstring\u0027: None, \u0027num_calls\u0027: 0, \u0027decorators\u0027: [\u0027setter\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.wrappers::max_form_parts", "label": "max_form_parts", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.wrappers::max_form_parts\u0027, \u0027module\u0027: \u0027src.flask.wrappers\u0027, \u0027name\u0027: \u0027max_form_parts\u0027, \u0027path\u0027: \u0027src/flask/wrappers.py\u0027, \u0027start_line\u0027: 143, \u0027end_line\u0027: 144, \u0027docstring\u0027: None, \u0027num_calls\u0027: 0, \u0027decorators\u0027: [\u0027setter\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.wrappers::endpoint", "label": "endpoint", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.wrappers::endpoint\u0027, \u0027module\u0027: \u0027src.flask.wrappers\u0027, \u0027name\u0027: \u0027endpoint\u0027, \u0027path\u0027: \u0027src/flask/wrappers.py\u0027, \u0027start_line\u0027: 147, \u0027end_line\u0027: 159, \u0027docstring\u0027: \u0027The endpoint that matched the request URL.\\n\\nThis will be ``None`` if matching failed or has not been\\nperformed yet.\\n\\nThis in combination with :attr:`view_args` can be used to\\nreconstruct the same URL or a modified URL.\u0027, \u0027num_calls\u0027: 0, \u0027decorators\u0027: [\u0027property\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.wrappers::blueprint", "label": "blueprint", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.wrappers::blueprint\u0027, \u0027module\u0027: \u0027src.flask.wrappers\u0027, \u0027name\u0027: \u0027blueprint\u0027, \u0027path\u0027: \u0027src/flask/wrappers.py\u0027, \u0027start_line\u0027: 162, \u0027end_line\u0027: 178, \u0027docstring\u0027: \u0027The registered name of the current blueprint.\\n\\nThis will be ``None`` if the endpoint is not part of a\\nblueprint, or if URL matching failed or has not been performed\\nyet.\\n\\nThis does not necessarily match the name the blueprint was\\ncreated with. It may have been nested, or registered with a\\ndifferent name.\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: [\u0027property\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.wrappers::blueprints", "label": "blueprints", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.wrappers::blueprints\u0027, \u0027module\u0027: \u0027src.flask.wrappers\u0027, \u0027name\u0027: \u0027blueprints\u0027, \u0027path\u0027: \u0027src/flask/wrappers.py\u0027, \u0027start_line\u0027: 181, \u0027end_line\u0027: 195, \u0027docstring\u0027: \u0027The registered names of the current blueprint upwards through\\nparent blueprints.\\n\\nThis will be an empty list if there is no current blueprint, or\\nif URL matching failed.\\n\\n.. versionadded:: 2.0.1\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: [\u0027property\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.wrappers::_load_form_data", "label": "_load_form_data", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.wrappers::_load_form_data\u0027, \u0027module\u0027: \u0027src.flask.wrappers\u0027, \u0027name\u0027: \u0027_load_form_data\u0027, \u0027path\u0027: \u0027src/flask/wrappers.py\u0027, \u0027start_line\u0027: 197, \u0027end_line\u0027: 210, \u0027docstring\u0027: None, \u0027num_calls\u0027: 3, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.wrappers::on_json_loading_failed", "label": "on_json_loading_failed", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.wrappers::on_json_loading_failed\u0027, \u0027module\u0027: \u0027src.flask.wrappers\u0027, \u0027name\u0027: \u0027on_json_loading_failed\u0027, \u0027path\u0027: \u0027src/flask/wrappers.py\u0027, \u0027start_line\u0027: 212, \u0027end_line\u0027: 219, \u0027docstring\u0027: None, \u0027num_calls\u0027: 3, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.wrappers::max_cookie_size", "label": "max_cookie_size", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.wrappers::max_cookie_size\u0027, \u0027module\u0027: \u0027src.flask.wrappers\u0027, \u0027name\u0027: \u0027max_cookie_size\u0027, \u0027path\u0027: \u0027src/flask/wrappers.py\u0027, \u0027start_line\u0027: 247, \u0027end_line\u0027: 257, \u0027docstring\u0027: \"Read-only view of the :data:`MAX_COOKIE_SIZE` config key.\\n\\nSee :attr:`~werkzeug.wrappers.Response.max_cookie_size` in\\nWerkzeug\u0027s docs.\", \u0027num_calls\u0027: 1, \u0027decorators\u0027: [\u0027property\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.logging::wsgi_errors_stream", "label": "wsgi_errors_stream", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.logging::wsgi_errors_stream\u0027, \u0027module\u0027: \u0027src.flask.logging\u0027, \u0027name\u0027: \u0027wsgi_errors_stream\u0027, \u0027path\u0027: \u0027src/flask/logging.py\u0027, \u0027start_line\u0027: 16, \u0027end_line\u0027: 28, \u0027docstring\u0027: \"Find the most appropriate error stream for the application. If a request\\nis active, log to ``wsgi.errors``, otherwise use ``sys.stderr``.\\n\\nIf you configure your own :class:`logging.StreamHandler`, you may want to\\nuse this for the stream. If you are using file or dict configuration and\\ncan\u0027t import this directly, you can refer to it as\\n``ext://flask.logging.wsgi_errors_stream``.\", \u0027num_calls\u0027: 0, \u0027decorators\u0027: [\u0027LocalProxy\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.logging::has_level_handler", "label": "has_level_handler", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.logging::has_level_handler\u0027, \u0027module\u0027: \u0027src.flask.logging\u0027, \u0027name\u0027: \u0027has_level_handler\u0027, \u0027path\u0027: \u0027src/flask/logging.py\u0027, \u0027start_line\u0027: 31, \u0027end_line\u0027: 47, \u0027docstring\u0027: \"Check if there is a handler in the logging chain that will handle the\\ngiven logger\u0027s :meth:`effective level \u003c~logging.Logger.getEffectiveLevel\u003e`.\", \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.logging::create_logger", "label": "create_logger", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.logging::create_logger\u0027, \u0027module\u0027: \u0027src.flask.logging\u0027, \u0027name\u0027: \u0027create_logger\u0027, \u0027path\u0027: \u0027src/flask/logging.py\u0027, \u0027start_line\u0027: 58, \u0027end_line\u0027: 79, \u0027docstring\u0027: \"Get the Flask app\u0027s logger and configure it if needed.\\n\\nThe logger name will be the same as\\n:attr:`app.import_name \u003cflask.Flask.name\u003e`.\\n\\nWhen :attr:`~flask.Flask.debug` is enabled, set the logger level to\\n:data:`logging.DEBUG` if it is not set.\\n\\nIf there is no handler for the logger\u0027s effective level, add a\\n:class:`~logging.StreamHandler` for\\n:func:`~flask.logging.wsgi_errors_stream` with a basic format.\", \u0027num_calls\u0027: 4, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sessions::SessionMixin", "label": "SessionMixin", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sessions::SessionMixin\u0027, \u0027module\u0027: \u0027src.flask.sessions\u0027, \u0027name\u0027: \u0027SessionMixin\u0027, \u0027path\u0027: \u0027src/flask/sessions.py\u0027, \u0027start_line\u0027: 24, \u0027end_line\u0027: 49, \u0027docstring\u0027: \u0027Expands a basic dictionary with session attributes.\u0027, \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sessions::SecureCookieSession", "label": "SecureCookieSession", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sessions::SecureCookieSession\u0027, \u0027module\u0027: \u0027src.flask.sessions\u0027, \u0027name\u0027: \u0027SecureCookieSession\u0027, \u0027path\u0027: \u0027src/flask/sessions.py\u0027, \u0027start_line\u0027: 52, \u0027end_line\u0027: 94, \u0027docstring\u0027: \u0027Base class for sessions based on signed cookies.\\n\\nThis session backend will set the :attr:`modified` and\\n:attr:`accessed` attributes. It cannot reliably track whether a\\nsession is new (vs. empty), so :attr:`new` remains hard coded to\\n``False``.\u0027, \u0027num_calls\u0027: 8, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sessions::NullSession", "label": "NullSession", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sessions::NullSession\u0027, \u0027module\u0027: \u0027src.flask.sessions\u0027, \u0027name\u0027: \u0027NullSession\u0027, \u0027path\u0027: \u0027src/flask/sessions.py\u0027, \u0027start_line\u0027: 97, \u0027end_line\u0027: 111, \u0027docstring\u0027: \u0027Class used to generate nicer error messages if sessions are not\\navailable.  Will still allow read-only access to the empty session\\nbut fail on setting.\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sessions::SessionInterface", "label": "SessionInterface", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sessions::SessionInterface\u0027, \u0027module\u0027: \u0027src.flask.sessions\u0027, \u0027name\u0027: \u0027SessionInterface\u0027, \u0027path\u0027: \u0027src/flask/sessions.py\u0027, \u0027start_line\u0027: 114, \u0027end_line\u0027: 284, \u0027docstring\u0027: \"The basic interface you have to implement in order to replace the\\ndefault session interface which uses werkzeug\u0027s securecookie\\nimplementation.  The only methods you have to implement are\\n:meth:`open_session` and :meth:`save_session`, the others have\\nuseful defaults which you don\u0027t need to change.\\n\\nThe session object returned by the :meth:`open_session` method has to\\nprovide a dictionary like interface plus the properties and methods\\nfrom the :class:`SessionMixin`.  We recommend just subclassing a dict\\nand adding that mixin::\\n\\n    class Session(dict, SessionMixin):\\n        pass\\n\\nIf :meth:`open_session` returns ``None`` Flask will call into\\n:meth:`make_null_session` to create a session that acts as replacement\\nif the session support cannot work because some requirement is not\\nfulfilled.  The default :class:`NullSession` class that is created\\nwill complain that the secret key was not set.\\n\\nTo replace the session interface on an application all you have to do\\nis to assign :attr:`flask.Flask.session_interface`::\\n\\n    app = Flask(__name__)\\n    app.session_interface = MySessionInterface()\\n\\nMultiple requests with the same session may be sent and handled\\nconcurrently. When implementing a new session interface, consider\\nwhether reads or writes to the backing store must be synchronized.\\nThere is no guarantee on the order in which the session for each\\nrequest is opened or saved, it will occur in the order that requests\\nbegin and end processing.\\n\\n.. versionadded:: 0.8\", \u0027num_calls\u0027: 5, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sessions::_lazy_sha1", "label": "_lazy_sha1", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sessions::_lazy_sha1\u0027, \u0027module\u0027: \u0027src.flask.sessions\u0027, \u0027name\u0027: \u0027_lazy_sha1\u0027, \u0027path\u0027: \u0027src/flask/sessions.py\u0027, \u0027start_line\u0027: 290, \u0027end_line\u0027: 295, \u0027docstring\u0027: \"Don\u0027t access ``hashlib.sha1`` until runtime. FIPS builds may not include\\nSHA-1, in which case the import and use as a default would fail before the\\ndeveloper can configure something else.\", \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sessions::SecureCookieSessionInterface", "label": "SecureCookieSessionInterface", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sessions::SecureCookieSessionInterface\u0027, \u0027module\u0027: \u0027src.flask.sessions\u0027, \u0027name\u0027: \u0027SecureCookieSessionInterface\u0027, \u0027path\u0027: \u0027src/flask/sessions.py\u0027, \u0027start_line\u0027: 298, \u0027end_line\u0027: 399, \u0027docstring\u0027: \u0027The default session interface that stores sessions in signed cookies\\nthrough the :mod:`itsdangerous` module.\u0027, \u0027num_calls\u0027: 30, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sessions::permanent", "label": "permanent", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sessions::permanent\u0027, \u0027module\u0027: \u0027src.flask.sessions\u0027, \u0027name\u0027: \u0027permanent\u0027, \u0027path\u0027: \u0027src/flask/sessions.py\u0027, \u0027start_line\u0027: 33, \u0027end_line\u0027: 34, \u0027docstring\u0027: None, \u0027num_calls\u0027: 1, \u0027decorators\u0027: [\u0027setter\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sessions::__init__", "label": "__init__", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sessions::__init__\u0027, \u0027module\u0027: \u0027src.flask.sessions\u0027, \u0027name\u0027: \u0027__init__\u0027, \u0027path\u0027: \u0027src/flask/sessions.py\u0027, \u0027start_line\u0027: 74, \u0027end_line\u0027: 82, \u0027docstring\u0027: None, \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sessions::__getitem__", "label": "__getitem__", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sessions::__getitem__\u0027, \u0027module\u0027: \u0027src.flask.sessions\u0027, \u0027name\u0027: \u0027__getitem__\u0027, \u0027path\u0027: \u0027src/flask/sessions.py\u0027, \u0027start_line\u0027: 84, \u0027end_line\u0027: 86, \u0027docstring\u0027: None, \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sessions::get", "label": "get", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sessions::get\u0027, \u0027module\u0027: \u0027src.flask.sessions\u0027, \u0027name\u0027: \u0027get\u0027, \u0027path\u0027: \u0027src/flask/sessions.py\u0027, \u0027start_line\u0027: 88, \u0027end_line\u0027: 90, \u0027docstring\u0027: None, \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sessions::setdefault", "label": "setdefault", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sessions::setdefault\u0027, \u0027module\u0027: \u0027src.flask.sessions\u0027, \u0027name\u0027: \u0027setdefault\u0027, \u0027path\u0027: \u0027src/flask/sessions.py\u0027, \u0027start_line\u0027: 92, \u0027end_line\u0027: 94, \u0027docstring\u0027: None, \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sessions::_fail", "label": "_fail", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sessions::_fail\u0027, \u0027module\u0027: \u0027src.flask.sessions\u0027, \u0027name\u0027: \u0027_fail\u0027, \u0027path\u0027: \u0027src/flask/sessions.py\u0027, \u0027start_line\u0027: 103, \u0027end_line\u0027: 108, \u0027docstring\u0027: None, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sessions::make_null_session", "label": "make_null_session", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sessions::make_null_session\u0027, \u0027module\u0027: \u0027src.flask.sessions\u0027, \u0027name\u0027: \u0027make_null_session\u0027, \u0027path\u0027: \u0027src/flask/sessions.py\u0027, \u0027start_line\u0027: 164, \u0027end_line\u0027: 174, \u0027docstring\u0027: \u0027Creates a null session which acts as a replacement object if the\\nreal session support could not be loaded due to a configuration\\nerror.  This mainly aids the user experience because the job of the\\nnull session is to still support lookup without complaining but\\nmodifications are answered with a helpful error message of what\\nfailed.\\n\\nThis creates an instance of :attr:`null_session_class` by default.\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sessions::is_null_session", "label": "is_null_session", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sessions::is_null_session\u0027, \u0027module\u0027: \u0027src.flask.sessions\u0027, \u0027name\u0027: \u0027is_null_session\u0027, \u0027path\u0027: \u0027src/flask/sessions.py\u0027, \u0027start_line\u0027: 176, \u0027end_line\u0027: 183, \u0027docstring\u0027: \u0027Checks if a given object is a null session.  Null sessions are\\nnot asked to be saved.\\n\\nThis checks if the object is an instance of :attr:`null_session_class`\\nby default.\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sessions::get_cookie_name", "label": "get_cookie_name", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sessions::get_cookie_name\u0027, \u0027module\u0027: \u0027src.flask.sessions\u0027, \u0027name\u0027: \u0027get_cookie_name\u0027, \u0027path\u0027: \u0027src/flask/sessions.py\u0027, \u0027start_line\u0027: 185, \u0027end_line\u0027: 187, \u0027docstring\u0027: \u0027The name of the session cookie. Uses``app.config[\"SESSION_COOKIE_NAME\"]``.\u0027, \u0027num_calls\u0027: 0, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sessions::get_cookie_domain", "label": "get_cookie_domain", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sessions::get_cookie_domain\u0027, \u0027module\u0027: \u0027src.flask.sessions\u0027, \u0027name\u0027: \u0027get_cookie_domain\u0027, \u0027path\u0027: \u0027src/flask/sessions.py\u0027, \u0027start_line\u0027: 189, \u0027end_line\u0027: 199, \u0027docstring\u0027: \u0027The value of the ``Domain`` parameter on the session cookie. If not set,\\nbrowsers will only send the cookie to the exact domain it was set from.\\nOtherwise, they will send it to any subdomain of the given value as well.\\n\\nUses the :data:`SESSION_COOKIE_DOMAIN` config.\\n\\n.. versionchanged:: 2.3\\n    Not set by default, does not fall back to ``SERVER_NAME``.\u0027, \u0027num_calls\u0027: 0, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sessions::get_cookie_path", "label": "get_cookie_path", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sessions::get_cookie_path\u0027, \u0027module\u0027: \u0027src.flask.sessions\u0027, \u0027name\u0027: \u0027get_cookie_path\u0027, \u0027path\u0027: \u0027src/flask/sessions.py\u0027, \u0027start_line\u0027: 201, \u0027end_line\u0027: 207, \u0027docstring\u0027: \"Returns the path for which the cookie should be valid.  The\\ndefault implementation uses the value from the ``SESSION_COOKIE_PATH``\\nconfig var if it\u0027s set, and falls back to ``APPLICATION_ROOT`` or\\nuses ``/`` if it\u0027s ``None``.\", \u0027num_calls\u0027: 0, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sessions::get_cookie_httponly", "label": "get_cookie_httponly", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sessions::get_cookie_httponly\u0027, \u0027module\u0027: \u0027src.flask.sessions\u0027, \u0027name\u0027: \u0027get_cookie_httponly\u0027, \u0027path\u0027: \u0027src/flask/sessions.py\u0027, \u0027start_line\u0027: 209, \u0027end_line\u0027: 214, \u0027docstring\u0027: \u0027Returns True if the session cookie should be httponly.  This\\ncurrently just returns the value of the ``SESSION_COOKIE_HTTPONLY``\\nconfig var.\u0027, \u0027num_calls\u0027: 0, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sessions::get_cookie_secure", "label": "get_cookie_secure", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sessions::get_cookie_secure\u0027, \u0027module\u0027: \u0027src.flask.sessions\u0027, \u0027name\u0027: \u0027get_cookie_secure\u0027, \u0027path\u0027: \u0027src/flask/sessions.py\u0027, \u0027start_line\u0027: 216, \u0027end_line\u0027: 220, \u0027docstring\u0027: \u0027Returns True if the cookie should be secure.  This currently\\njust returns the value of the ``SESSION_COOKIE_SECURE`` setting.\u0027, \u0027num_calls\u0027: 0, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sessions::get_cookie_samesite", "label": "get_cookie_samesite", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sessions::get_cookie_samesite\u0027, \u0027module\u0027: \u0027src.flask.sessions\u0027, \u0027name\u0027: \u0027get_cookie_samesite\u0027, \u0027path\u0027: \u0027src/flask/sessions.py\u0027, \u0027start_line\u0027: ction\u0027, \u0027symbol_id\u0027: \u0027src.flask.sessions::should_set_cookie\u0027, \u0027module\u0027: \u0027src.flask.sessions\u0027, \u0027name\u0027: \u0027should_set_cookie\u0027, \u0027path\u0027: \u0027src/flask/sessions.py\u0027, \u0027start_line\u0027: 247, \u0027end_line\u0027: 261, \u0027docstring\u0027: \u0027Used by session backends to determine if a ``Set-Cookie`` header\\nshould be set for this session cookie for this response. If the session\\nhas been modified, the cookie is set. If the session is permanent and\\nthe ``SESSION_REFRESH_EACH_REQUEST`` config is true, the cookie is\\nalways set.\\n\\nThis check is usually skipped if the session was deleted.\\n\\n.. versionadded:: 0.11\u0027, \u0027num_calls\u0027: 0, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sessions::open_session", "label": "open_session", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sessions::open_session\u0027, \u0027module\u0027: \u0027src.flask.sessions\u0027, \u0027name\u0027: \u0027open_session\u0027, \u0027path\u0027: \u0027src/flask/sessions.py\u0027, \u0027start_line\u0027: 337, \u0027end_line\u0027: 349, \u0027docstring\u0027: None, \u0027num_calls\u0027: 9, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sessions::save_session", "label": "save_session", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sessions::save_session\u0027, \u0027module\u0027: \u0027src.flask.sessions\u0027, \u0027name\u0027: \u0027save_session\u0027, \u0027path\u0027: \u0027src/flask/sessions.py\u0027, \u0027start_line\u0027: 351, \u0027end_line\u0027: 399, \u0027docstring\u0027: None, \u0027num_calls\u0027: 17, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sessions::get_signing_serializer", "label": "get_signing_serializer", "shape": "dot", "title": "{\u0027node_type\u0027: oup` but you can also manually create it and pass it\\nonwards as click object.\\n\\n.. versionchanged:: 3.1\\n    Added the ``load_dotenv_defaults`` parameter and attribute.\", \u0027num_calls\u0027: 9, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.cli::with_appcontext", "label": "with_appcontext", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.cli::with_appcontext\u0027, \u0027module\u0027: \u0027src.flask.cli\u0027, \u0027name\u0027: \u0027with_appcontext\u0027, \u0027path\u0027: \u0027src/flask/cli.py\u0027, \u0027start_line\u0027: 380, \u0027end_line\u0027: 402, \u0027docstring\u0027: \"Wraps a callback so that it\u0027s guaranteed to be executed with the\\nscript\u0027s application context.\\n\\nCustom commands (and their options) registered under ``app.cli`` or\\n``blueprint.cli`` will always have an app context available, this\\ndecorator is not required in that case.\\n\\n.. versionchanged:: 2.2\\n    The app context is active for subcommands as well as the\\n    decorated callback. The app context is always available to\\n    ``app.cli`` command and parameter callbacks.\", \u0027num_calls\u0027: 6, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.cli::AppGroup", "label": "AppGroup", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.cli::AppGroup\u0027, \u0027module\u0027: \u0027src.flask.cli\u0027, \u0027name\u0027: \u0027AppGroup\u0027, \u0027path\u0027: \u0027src/flask/cli.py\u0027, \u0027start_line\u0027: 405, \u0027end_line\u0027: 437, \u0027docstring\u0027: \u0027This works similar to a regular click :class:`~click.Group` but it\\nchanges the behavior of the :meth:`command` decorator so that it\\nautomatically wraps the functions in :func:`with_appcontext`.\\n\\nNot to be confused with :class:`FlaskGroup`.\u0027, \u0027num_calls\u0027: 7, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.cli::_set_app", "label": "_set_app", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.cli::_set_app\u0027, \u0027module\u0027: \u0027src.flask.cli\u0027, \u0027name\u0027: \u0027_set_app\u0027, \u0027path\u0027: \u0027src/flask/cli.py\u0027, \u0027start_line\u0027: 440, \u0027end_line\u0027: 446, \u0027docstring\u0027: None, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.cli::_set_debug", "label": "_set_debug", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.cli::_set_debug\u0027, \u0027module\u0027: \u0027src.flask.cli\u0027, \u0027name\u0027: \u0027_set_debug\u0027, \u0027path\u0027: \u0027src/flask/cli.py\u0027, \u0027start_line\u0027: 468, \u0027end_line\u0027: 482, \u0027docstring\u0027: None, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.cli::_env_file_callback", "label": "_env_file_callback", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.cli::_env_file_callback\u0027, \u0027module\u0027: \u0027src.flask.cli\u0027, \u0027name\u0027: \u0027_env_file_callback\u0027, \u0027path\u0027: \u0027src/flask/cli.py\u0027, \u0027start_line\u0027: 493, \u0027end_line\u0027: 512, \u0027docstring\u0027: None, \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.cli::FlaskGroup", "label": "FlaskGroup", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.cli::FlaskGroup\u0027, \u0027module\u0027: \u0027src.flask.cli\u0027, \u0027name\u0027: \u0027FlaskGroup\u0027, \u0027path\u0027: \u0027src/flask/cli.py\u0027, \u0027start_line\u0027: 531, \u0027end_line\u0027: 688, \u0027docstring\u0027: \"Special subclass of the :class:`AppGroup` group that supports\\nloading more commands from the configured Flask app.  Normally a\\ndeveloper does not have to interface with this class but there are\\nsome very advanced use cases for which it makes sense to create an\\ninstance of this. see :ref:`custom-scripts`.\\n\\n:param add_default_commands: if this is True then the default run and\\n    shell commands will be added.\\n:param add_version_option: adds the ``--version`` option.\\n:param create_app: an optional callback that is passed the script info and\\n    returns the loaded app.\\n:param load_dotenv: Load the nearest :file:`.env` and :file:`.flaskenv`\\n    files to set environment variables. Will also change the working\\n    directory to the directory containing the first file found.\\n:param set_debug_flag: Set the app\u0027s debug flag.\\n\\n.. versionchanged:: 3.1\\n    ``-e path`` takes precedence over default ``.env`` and ``.flaskenv`` files.\\n\\n.. versionchanged:: 2.2\\n    Added the ``-A/--app``, ``--debug/--no-debug``, ``-e/--env-file`` options.\\n\\n.. versionchanged:: 2.2\\n    An app context is pushed when running ``app.cli`` commands, so\\n    ``@with_appcontext`` is no longer required for those commands.\\n\\n.. versionchanged:: 1.0\\n    If installed, python-dotenv will be used to load environment variables\\n    from :file:`.env` and :file:`.flaskenv` files.\", \u0027num_calls\u0027: 46, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.cli::_path_is_ancestor", "label": "_path_is_ancestor", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.cli::_path_is_ancestor\u0027, \u0027module\u0027: \u0027src.flask.cli\u0027, \u0027name\u0027: \u0027_path_is_ancestor\u0027, \u0027path\u0027: \u0027src/flask/cli.py\u0027, \u0027start_line\u0027: 691, \u0027end_line\u0027: 695, \u0027docstring\u0027: \u0027Take ``other`` and remove the length of ``path`` from it. Then join it\\nto ``path``. If it is the original value, ``path`` is an ancestor of\\n``other``.\u0027, \u0027num_calls\u0027: 3, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.cli::load_dotenv", "label": "load_dotenv", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.cli::load_dotenv\u0027, \u0027module\u0027: \u0027src.flask.cli\u0027, \u0027name\u0027: \u0027load_dotenv\u0027, \u0027path\u0027: \u0027src/flask/cli.py\u0027, \u0027start_line\u0027: 698, \u0027end_line\u0027: 763, \u0027docstring\u0027: \u0027Load \"dotenv\" files to set environment variables. A given path takes\\nprecedence over ``.env``, which takes precedence over ``.flaskenv``. After\\nloading and combining these files, values are only set if the key is not\\nalready set in ``os.environ``.\\n\\nThis is a no-op if `python-dotenv`_ is not installed.\\n\\n.. _python-dotenv: https://github.com/theskumar/python-dotenv#readme\\n\\n:param path: Load the file at this location.\\n:param load_defaults: Search for and load the default ``.flaskenv`` and\\n    ``.env`` files.\\n:return: ``True`` if at least one env var was loaded.\\n\\n.. versionchanged:: 3.1\\n    Added the ``load_defaults`` parameter. A given path takes precedence\\n    over default files.\\n\\n.. versionchanged:: 2.0\\n    The current directory is not changed to the location of the\\n    loaded file.\\n\\n.. versionchanged:: 2.0\\n    When loading the env files, set the default encoding to UTF-8.\\n\\n.. versionchanged:: 1.1.0\\n    Returns ``False`` when python-dotenv is not installed, or when\\n    the given path isn\\\u0027t a file.\\n\\n.. versionadded:: 1.0\u0027, \u0027num_calls\u0027: 9, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.cli::show_server_banner", "label": "show_server_banner", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.cli::show_server_banner\u0027, \u0027module\u ctx\u0027, \u0027name\u0027: \u0027_AppCtxGlobals\u0027, \u0027path\u0027: \u0027src/flask/ctx.py\u0027, \u0027start_line\u0027: 29, \u0027end_line\u0027: 114, \u0027docstring\u0027: \"A plain object. Used as a namespace for storing data during an\\napplication context.\\n\\nCreating an app context automatically creates this object, which is\\nmade available as the :data:`.g` proxy.\\n\\n.. describe:: \u0027key\u0027 in g\\n\\n    Check whether an attribute is present.\\n\\n    .. versionadded:: 0.10\\n\\n.. describe:: iter(g)\\n\\n    Return an iterator over the attribute names.\\n\\n    .. versionadded:: 0.10\", \u0027num_calls\u0027: 9, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.ctx::after_this_request", "label": "after_this_request", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.ctx::after_this_request\u0027, \u0027module\u0027: \u0027src.flask.ctx\u0027, \u0027name\u0027: \u0027after_this_request\u0027, \u0027path\u0027: \u0027src/flask/ctx.py\u0027, \u0027start_line\u0027: 117, \u0027end_line\u0027: 147, \u0027docstring\u0027: \u0027Decorate a function to run after the current request. The behavior is the\\nsame as :meth:`.Flask.after_request`, except it only applies to the current\\nrequest, rather than every request. Therefore, it must be used within a\\nrequest context, rather than during setup.\\n\\n.. code-block:: python\\n\\n    @app.route(\"/\")\\n    def index():\\n        @after_this_request\\n        def add_header(response):\\n            response.headers[\"X-Foo\"] = \"Parachute\"\\n            return response\\n\\n        return \"Hello, World!\"\\n\\n.. versionadded:: 0.9\u0027, \u0027num_calls\u0027: 3, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.ctx::copy_current_request_context", "label": "copy_current_request_context", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.ctx::copy_current_request_context\u0027, \u0027module\u0027: \u0027src.flask.ctx\u0027, \u0027name\u0027: \u0027copy_current_request_context\u0027, \u0027path\u0027: \u0027src/flask/ctx.py\u0027, \u0027start_line\u0027: 153, \u0027end_line\u0027: 205, \u0027docstring\u0027: \"Decorate a function to run inside the current request context. This can\\nbe used when starting a background task, otherwise it will not see the app\\nand request objects that were active in the parent.\\n\\n.. warning::\\n\\n    Due to the following caveats, it is often safer (and simpler) to pass\\n    the data you need when starting the task, rather than using this and\\n    relying on the context objects.\\n\\nIn order to avoid execution switching partially though reading data, either\\nread the request body (access ``form``, ``json``, ``data``, etc) before\\nstarting the task, or use a lock. This can be an issue when using threading,\\nbut shouldn\u0027t be an issue when using greenlet/gevent or asyncio.\\n\\nIf the task will access ``session``, be sure to do so in the parent as well\\nso that the ``Vary: cookie`` header will be set. Modifying ``session`` in\\nthe task should be avoided, as it may execute after the response cookie has\\nalready been written.\\n\\n.. code-block:: python\\n\\n    import gevent\\n    from flask import copy_current_request_context\\n\\n    @app.route(\u0027/\u0027)\\n    def index():\\n        @copy_current_request_context\\n        def do_some_work():\\n            # do some work here, it can access flask.request or\\n            # flask.session like you would otherwise in the view function.\\n            ...\\n        gevent.spawn(do_some_work)\\n        return \u0027Regular response\u0027\\n\\n.. versionadded:: 0.10\", \u0027num_calls\u0027: 5, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.ctx::has_request_context", "label": "has_request_context", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.ctx::has_request_context\u0027, \u0027module\u0027: \u0027src.flask.ctx\u0027, \u0027name\u0027: \u0027has_request_context\u0027, \u0027path\u0027: \u0027src/flask/ctx.py\u0027, \u0027start_line\u0027: 208, \u0027end_line\u0027: 231, \u0027docstring\u0027: \u0027Test if an app context is active and if it has request information.\\n\\n.. code-block:: python\\n\\n    from flask import has_request_context, request\\n\\n    if has_request_context():\\n        remote_addr = request.remote_addr\\n\\nIf a request context is active, the :data:`.request` and :data:`.session`\\ncontext proxies will available and ``True``, otherwise ``False``. You can\\nuse that to test the data you use, rather than using this function.\\n\\n.. code-block:: python\\n\\n    from flask import request\\n\\n    if request:\\n        remote_addr = request.remote_addr\\n\\n.. versionadded:: 0.7\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.ctx::has_app_context", "label": "has_app_context", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.ctx::has_app_context\u0027, \u0027module\u0027: \u0027src.flask.ctx\u0027, \u0027name\u0027: \u0027has_app_context\u0027, \u0027path\u0027: \u0027src/flask/ctx.py\u0027, \u0027start_line\u0027: 234, \u0027end_line\u0027: 256, \u0027docstring\u0027: \u0027Test if an app context is active. Unlike :func:`has_request_context`\\nthis can be true outside a request, such as in a CLI command.\\n\\n.. code-block:: python\\n\\n    from flask import has_app_context, g\\n\\n    if has_app_context():\\n        g.cached_data = ...\\n\\nIf an app context is active, the :data:`.g` and :data:`.current_app` context\\nproxies will available and ``True``, otherwise ``False``. You can use that\\nto test the data you use, rather than using this function.\\n\\n    from flask import g\\n\\n    if g:\\n        g.cached_data = ...\\n\\n.. versionadded:: 0.9\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.ctx::AppContext", "label": "AppContext", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.ctx::AppContext\u0027, \u0027module\u0027: \u0027src.flask.ctx\u0027, \u0027name\u0027: \u0027AppContext\u0027, \u0027path\u0027: \u0027src/flask/ctx.py\u0027, \u0027start_line\u0027: 259, \u0027end_line\u0027: 501, \u0027docstring\u0027: \u0027An app context contains information about an app, and about the request\\nwhen handling a request. A context is pushed at the beginning of each\\nrequest and CLI command, and popped at the end. The context is referred to\\nas a \"request context\" if it has request information, and an \"app context\"\\nif not.\\n\\nDo not use this class directly. Use :meth:`.Flask.app_context` to create an\\napp context if needed during setup, and :meth:`.Flask.test_request_context`\\nto create a request context if needed during tests.\\n\\nWhen the context is popped, it will evaluate all the teardown functions\\nregistered with :meth:`~flask.Flask.teardown_request` (if handling a\\nrequest) then :meth:`.Flask.teardown_appcontext`.\\n\\nWhen using the interactive debugger, the context will be restored so\\n``request`` is still accessible. Similarly, the test client can preserve the\\ncontext after the request ends. However, teardown functions may already have\\nclosed some resources such as database connections, and will run again when\\nthe restored context is popped.\\n\\n:param app: The application this context represents.\\n:param request: The request data this context represents.\\n:param session: The session data this context represents. If not given,\\n    loaded from the request on first access.\\n\\n.. versionchanged:: 3.2\\n    Merged with ``RequestContext``. The ``RequestContext`` alias will be\\n    removed in Flask 4.0.\\n\\n.. versionchanged:: 3.2\\n    A combined app and request context is pushed for every request and CLI\\n    command, rather than trying to detect if an app context is already\\n    pushed.\\n\\n.. versionchanged:: 3.2\\n    The session is loaded the first time it is accessed, rather than when\\n    the context is pushed.\u0027, \u0027num_calls\u0027: 28, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.ctx::__getattr__", "label": "__getattr__", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.ctx::__getattr__\u0027, \u0027module\u0027: \u0027src.flask.ctx\u0027, \u0027name\u0027: \u0027__getattr__\u0027, \u0027path\u0027: \u0027src/flask/ctx.py\u0027, \u0027start_line\u0027: 52, \u0027end_line\u0027: 56, \u0027docstring\u0027: None, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.ctx::__setattr__", "label": "__setattr__", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.ctx::__setattr__\u0027, \u0027module\u0027: \u0027src.flask.ctx\u0027, \u0027name\u0027: \u0027__setattr__\u0027, \u0027path\u0027: \u0027src/flask/ctx.py\u0027, \u0027start_line\u0027: 58, \u0027end_line\u0027: 59, \u0027docstring\u0027: None, \u0027num_calls\u0027: 0, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.ctx::__delattr__", "label": "__delattr__", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.ctx::__delattr__\u0027, \u0027module\u0027: \u0027src.flask.ctx\u0027, \u0027name\u0027: \u0027__delattr__\u0027, \u0027path\u0027: \u0027src/flask/ctx.py\u0027, \u0027start_line\u0027: 61, \u0027end_line\u0027: 65, \u0027docstring\u0027: None, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.ctx::get", "label": "get", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.ctx::get\u0027, \u0027module\u0027: \u0027src.flask.ctx\u0027, \u0027name\u0027: \u0027get\u0027, \u0027path\u0027: \u0027src/flask/ctx.py\u0027, \u0027start_line\u0027: 67, \u0027end_line\u0027: 76, \u0027docstring\u0027: \u0027Get an attribute by name, or a default value. Like\\n:meth:`dict.get`.\\n\\n:param name: Name of attribute to get.\\n:param default: Value to return if the attribute is not present.\\n\\n.. versionadded:: 0.10\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.ctx::pop", "label": "pop", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.ctx::pop\u0027, \u0027module\u0027: \u0027src.flask.ctx\u0027, \u0027name\u0027: \u0027pop\u0027, \u0027path\u0027: \u0027src/flask/ctx.py\u0027, \u0027start_line\u0027: 432, \u0027end_line\u0027: 480, \u0027docstring\u0027: \u0027Pop this context so that it is no longer the active context. Then\\ncall teardown functions and signals.\\n\\nTypically, this is not used directly. Instead, use a ``with`` block\\nto manage the context.\\n\\nThis context must currently be the active context, otherwise a\\n:exc:`RuntimeError` is raised. In some situations, such as streaming or\\ntesting, the context may have been pushed multiple times. It will only\\ntrigger cleanup once it has been popped as many times as it was pushed.\\nUntil then, it will remain the active context.\\n\\n:param exc: An unhandled exception that was raised while the context was\\n    active. Passed to teardown functions.\\n\\n.. versionchanged:: 0.9\\n    Added the ``exc`` argument.\u0027, \u0027num_calls\u0027: 9, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.ctx::setdefault", "label": "setdefault", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.ctx::setdefault\u0027, \u0027module\u0027: \u0027src.flask.ctx\u0027, \u0027name\u0027: \u0027setdefault\u0027, \u0027path\u0027: \u0027src/flask/ctx.py\u0027, \u0027start_line\u0027: 92, \u0027end_line\u0027: 102, \u0027docstring\u0027: \u0027Get the value of an attribute if it is present, otherwise\\nset and return a default value. Like :meth:`dict.setdefault`.\\n\\n:param name: Name of attribute to get.\\n:param default: Value to set and return if the attribute is not\\n    present.\\n\\n.. versionadded:: 0.11\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.ctx::__contains__", "label": "__contains__", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.ctx::__contains__\u0027, \u0027module\u0027: \u0027src.flask.ctx\u0027, \u0027name\u0027: \u0027__contains__\u0027, \u0027path\u0027: \u0027src/flask/ctx.py\u0027, \u0027start_line\u0027: 104, \u0027end_line\u0027: 105, \u0027docstring\u0027: None, \u0027num_calls\u0027: 0, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.ctx::__iter__", "label": "__iter__", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.ctx::__iter__\u0027, \u0027module\u0027: \u0027src.flask.ctx\u0027, \u0027name\u0027: \u0027__iter__\u0027, \u0027path\u0027: \u0027src/flask/ctx.py\u0027, \u0027start_line\u0027: 107, \u0027end_line\u0027: 108, \u0027docstring\u0027: None, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.ctx::__repr__", "label": "__repr__", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.ctx::__repr__\u0027, \u0027module\u0027: \u0027src.flask.ctx\u0027, \u0027name\u0027: \u0027__repr__\u0027, \u0027path\u0027: \u0027src/flask/ctx.py\u0027, \u0027start_line\u0027: 494, \u0027end_line\u0027: 501, \u0027docstring\u0027: None, \u0027num_calls\u0027: 4, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.ctx::wrapper", "label": "wrapper", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.ctx::wrapper\u0027, \u0027module\u0027: \u0027src.flask.ctx\u0027, \u0027name\u0027: \u0027wrapper\u0027, \u0027path\u0027: \u0027src/flask/ctx.py\u0027, \u0027start_line\u0027: 201, \u0027end_line\u0027: 203, \u0027docstring\u0027: None, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.ctx::__init__", "label": "__init__", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.ctx::__init__\u0027, \u0027module\u0027: \u0027src.flask.ctx\u0027, \u0027name\u0027: \u0027__init__\u0027, \u0027path\u0027: \u0027src/flask/ctx.py\u0027, \u0027start_line\u0027: 299, \u0027end_line\u0027: 336, \u0027docstring\u0027: None, \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.ctx::from_environ", "label": "from_environ", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.ctx::from_environ\u0027, \u0027module\u0027: \u0027src.flask.ctx\u0027, \u0027name\u0027: \u0027from_environ\u0027, \u0027path\u0027: \u0027src/flask/ctx.py\u0027, \u0027start_line\u0027: 339, \u0027end_line\u0027: 347, \u0027docstring\u0027: \u0027Create an app context with request data from the given WSGI environ.\\n\\n:param app: The application this context represents.\\n:param environ: The request data this context represents.\u0027, \u0027num_calls\u0027: 2, \u0027decorators\u0027: [\u0027classmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.ctx::has_request", "label": "has_request", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.ctx::has_request\u0027, \u0027 src.flask.ctx\u0027, \u0027name\u0027: \u0027session\u0027, \u0027path\u0027: \u0027src/flask/ctx.py\u0027, \u0027start_line\u0027: 381, \u0027end_line\u0027: 396, \u0027docstring\u0027: \u0027The session object associated with this context. Accessed through\\n:data:`.session`. Only available in request contexts, otherwise raises\\n:exc:`RuntimeError`.\u0027, \u0027num_calls\u0027: 3, \u0027decorators\u0027: [\u0027property\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.ctx::match_request", "label": "match_request", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.ctx::match_request\u0027, \u0027module\u0027: \u0027src.flask.ctx\u0027, \u0027name\u0027: \u0027match_request\u0027, \u0027path\u0027: \u0027src/flask/ctx.py\u0027, \u0027start_line\u0027: 398, \u0027end_line\u0027: 407, \u0027docstring\u0027: \u0027Apply routing to the current request, storing either the matched\\nendpoint and args, or a routing exception.\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.ctx::push", "label": "push", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.ctx::push\u0027, \u0027module\u0027: \u0027src.flask.ctx\u0027, \u0027name\u0027: \u0027push\u0027, \u0027path\u0027: \u0027src/flask/ctx.py\u0027, \u0027start_line\u0027: 409, \u0027end_line\u0027: 430, \u0027docstring\u0027: \u0027Push this context so that it is the active context. If this is a\\nrequest context, calls :meth:`match_request` to perform routing with\\nthe context active.\\n\\nTypically, this is not used directly. Instead, use a ``with`` block\\nto manage the context.\\n\\nIn some situations, such as streaming or testing, the context may be\\npushed multiple times. It will only trigger matching and signals if it\\nis not currently pushed.\u0027, \u0027num_calls\u0027: 3, \u0027decorators\u0027: []}"}, {"color": "#66cc6
