older of static files to serve.\\n    If this is set, a static route will be added.\\n:param static_url_path: URL prefix for the static route.\\n:param template_folder: Path to a folder containing template files.\\n    for rendering. If this is set, a Jinja loader will be added.\\n:param root_path: The path that static, template, and resource files\\n    are relative to. Typically not set, it is discovered based on\\n    the ``import_name``.\\n\\n.. versionadded:: 2.0\u0027, \u0027num_calls\u0027: 45, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.scaffold::_endpoint_from_view_func", "label": "_endpoint_from_view_func", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.scaffold::_endpoint_from_view_func\u0027, \u0027module\u0027: \u0027src.flask.sansio.scaffold\u0027, \u0027name\u0027: \u0027_endpoint_from_view_func\u0027, \u0027path\u0027: \u0027src/flask/sansio/scaffold.py\u0027, \u0027start_line\u0027: 701, \u0027end_line\u0027: 706, \u0027docstring\u0027: \u0027Internal helper that returns the default endpoint for a given\\nfunction.  This always is the function name.\u0027, \u0027num_calls\u0027: 0, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.scaffold::_find_package_path", "label": "_find_package_path", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.scaffold::_find_package_path\u0027, \u0027module\u0027: \u0027src.flask.sansio.scaffold\u0027, \u0027name\u0027: \u0027_find_package_path\u0027, \u0027path\u0027: \u0027src/flask/sansio/scaffold.py\u0027, \u0027start_line\u0027: 709, \u0027end_line\u0027: 751, \u0027docstring\u0027: \u0027Find the path that contains the package or module.\u0027, \u0027num_calls\u0027: 13, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.scaffold::find_package", "label": "find_package", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.scaffold::find_package\u0027, \u0027module\u0027: \u0027src.flask.sansio.scaffold\u0027, \u0027name\u0027: \u0027find_package\u0027, \u0027path\u0027: \u0027src/flask/sansio/scaffold.py\u0027, \u0027start_line\u0027: 754, \u0027end_line\u0027: 792, \u0027docstring\u0027: \"Find the prefix that a package is installed under, and the path\\nthat it would be imported from.\\n\\nThe prefix is the directory containing the standard directory\\nhierarchy (lib, bin, etc.). If the package is not installed to the\\nsystem (:attr:`sys.prefix`) or a virtualenv (``site-packages``),\\n``None`` is returned.\\n\\nThe path is the entry in :attr:`sys.path` that contains the package\\nfor import. If the package is not installed, it\u0027s assumed that the\\npackage was imported from the current working directory.\", \u0027num_calls\u0027: 11, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.scaffold::wrapper_func", "label": "wrapper_func", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.scaffold::wrapper_func\u0027, \u0027module\u0027: \u0027src.flask.sansio.scaffold\u0027, \u0027name\u0027: \u0027wrapper_func\u0027, \u0027path\u0027: \u0027src/flask/sansio/scaffold.py\u0027, \u0027start_line\u0027: 45, \u0027end_line\u0027: 47, \u0027docstring\u0027: None, \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.scaffold::__init__", "label": "__init__", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.scaffold::__init__\u0027, \u0027module\u0027: \u0027src.flask.sansio.scaffold\u0027, \u0027name\u0027: \u0027__init__\u0027, \u0027path\u0027: \u0027src/flask/sansio/scaffold.py\u0027, \u0027start_line\u0027: 75, \u0027end_line\u0027: 215, \u00 u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.scaffold::_method_route\u0027, \u0027module\u0027: \u0027src.flask.sansio.scaffold\u0027, \u0027name\u0027: \u0027_method_route\u0027, \u0027path\u0027: \u0027src/flask/sansio/scaffold.py\u0027, \u0027start_line\u0027: 284, \u0027end_line\u0027: 293, \u0027docstring\u0027: None, \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.scaffold::get", "label": "get", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.scaffold::get\u0027, \u0027module\u0027: \u0027src.flask.sansio.scaffold\u0027, \u0027name\u0027: \u0027get\u0027, \u0027path\u0027: \u0027src/flask/sansio/scaffold.py\u0027, \u0027start_line\u0027: 296, \u0027end_line\u0027: 301, \u0027docstring\u0027: \u0027Shortcut for :meth:`route` with ``methods=[\"GET\"]``.\\n\\n.. versionadded:: 2.0\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.scaffold::post", "label": "post", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.scaffold::post\u0027, \u0027module\u0027: \u0027src.flask.sansio.scaffold\u0027, \u0027name\u0027: \u0027post\u0027, \u0027path\u0027: \u0027src/flask/sansio/scaffold.py\u0027, \u0027start_line\u0027: 304, \u0027end_line\u0027: 309, \u0027docstring\u0027: \u0027Shortcut for :meth:`route` with ``methods=[\"POST\"]``.\\n\\n.. versionadded:: 2.0\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.scaffold::put", "label": "put", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.scaffold::put\u0027, \u0027module\u0027: \u0027src.flask.sansio.scaffold\u0027, \u0027name\u0027: \u0027put\u0027, \u0027path\u0027: \u0027src/flask/sansio/scaffold.py\u0027, \u0027start_line\u0027: 312, \u0027end_line\u0027: 317, \u0027docstring\u0027: \u0027Shortcut for :meth:`route` with ``methods=[\"PUT\"]``.\\n\\n.. versionadded:: 2.0\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.scaffold::delete", "label": "delete", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.scaffold::delete\u0027, \u0027module\u0027: \u0027src.flask.sansio.scaffold\u0027, \u0027name\u0027: \u0027delete\u0027, \u0027path\u0027: \u0027src/flask/sansio/scaffold.py\u0027, \u0027start_line\u0027: 320, \u0027end_line\u0027: 325, \u0027docstring\u0027: \u0027Shortcut for :meth:`route` with ``methods=[\"DELETE\"]``.\\n\\n.. versionadded:: 2.0\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.scaffold::patch", "label": "patch", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.scaffold::patch\u0027, \u0027module\u0027: \u0027src.flask.sansio.scaffold\u0027, \u0027name\u0027: \u0027patch\u0027, \u0027path\u0027: \u0027src/flask/sansio/scaffold.py\u0027, \u0027start_line\u0027: 328, \u0027end_line\u0027: 333, \u0027docstring\u0027: \u0027Shortcut for :meth:`route` with ``methods=[\"PATCH\"]``.\\n\\n.. versionadded:: 2.0\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.scaffold::route", "label": "route", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.scaffold::route\u0027, \u0027module\u0027: \u0027src.flask.sansio.scaffold\u0027, \u0027name\u0027: \u0027route\u0027, \u0027path\u0027: \u0027src/flask/sansio/scaffold.py\u0027, \u0027start_line\u0027: 336, \u0027end_line\u0027: 365, \u0027docstring\u0027: \u0027Decorate a view function to register it with the given URL\\nrule and options. Calls :meth:`add_url_rule`, which has more\\ndetails about the implementation.\\n\\n.. code-block:: python\\n\\n    @app.route(\"/\")\\n    def index():\\n        return \"Hello, World!\"\\n\\nSee :ref:`url-route-registrations`.\\n\\nThe endpoint name for the route defaults to the name of the view\\nfunction if the ``endpoint`` parameter isn\\\u0027t passed.\\n\\nThe ``methods`` parameter defaults to ``[\"GET\"]``. ``HEAD`` and\\n``OPTIONS`` are added automatically.\\n\\n:param rule: The URL rule string.\\n:param options: Extra options passed to the\\n    :class:`~werkzeug.routing.Rule` object.\u0027, \u0027num_calls\u0027: 2, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.scaffold::add_url_rule", "label": "add_url_rule", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.scaffold::add_url_rule\u0027, \u0027module\u0027: \u0027src.flask.sansio.scaffold\u0027, \u0027name\u0027: \u0027add_url_rule\u0027, \u0027path\u0027: \u0027src/flask/sansio/scaffold.py\u0027, \u0027start_line\u0027: 368, \u0027end_line\u0027: 433, \u0027docstring\u0027: \u0027Register a rule for routing incoming requests and building\\nURLs. The :meth:`route` decorator is a shortcut to call this\\nwith the ``view_func`` argument. These are equivalent:\\n\\n.. code-block:: python\\n\\n    @app.route(\"/\")\\n    def index():\\n        ...\\n\\n.. code-block:: python\\n\\n    def index():\\n        ...\\n\\n    app.add_url_rule(\"/\", view_func=index)\\n\\nSee :ref:`url-route-registrations`.\\n\\nThe endpoint name for the route defaults to the name of the view\\nfunction if the ``endpoint`` parameter isn\\\u0027t passed. An error\\nwill be raised if a function has already been registered for the\\nendpoint.\\n\\nThe ``methods`` parameter defaults to ``[\"GET\"]``. ``HEAD`` is\\nalways added automatically, and ``OPTIONS`` is added\\nautomatically by default.\\n\\n``view_func`` does not necessarily need to be passed, but if the\\nrule should participate in routing an endpoint name must be\\nassociated with a view function at some point with the\\n:meth:`endpoint` decorator.\\n\\n.. code-block:: python\\n\\n    app.add_url_rule(\"/\", endpoint=\"index\")\\n\\n    @app.endpoint(\"index\")\\n    def index():\\n        ...\\n\\nIf ``view_func`` has a ``required_methods`` attribute, those\\nmethods are added to the passed and automatic methods. If it\\nhas a ``provide_automatic_methods`` attribute, it is used as the\\ndefault if the parameter is not passed.\\n\\n:param rule: The URL rule string.\\n:param endpoint: The endpoint name to associate with the rule\\n    and view function. Used when routing and building URLs.\\n    Defaults to ``view_func.__name__``.\\n:param view_func: The view function to associate with the\\n    endpoint name.\\n:param provide_automatic_options: Add the ``OPTIONS`` method and\\n    respond to ``OPTIONS`` requests automatically.\\n:param options: Extra options passed to the\\n    :class:`~werkzeug.routing.Rule` object.\u0027, \u0027num_calls\u0027: 0, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.scaffold::endpoint", "label": "endpoint", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.scaffold::endpoint\u0027, \u0027module\u0027: \u0027src.flask.sansio.scaffold\u0027, \u0027name\u0027: \u0027endpoint\u0027, \u0027path\u0027: \u0027src/flask/sansio/scaffold.py\u0027, \u0027start_line\u0027: 436, \u0027end_line\u0027: 457, \u0027docstring\u0027: \u0027Decorate a view function to register it for the given\\nendpoint. Used if a rule is added without a ``view_func`` with\\n:meth:`add_url_rule`.\\n\\n.. code-block:: python\\n\\n    app.add_url_rule(\"/ex\", endpoint=\"example\")\\n\\n    @app.endpoint(\"example\")\\n    def example():\\n        ...\\n\\n:param endpoint: The endpoint name to associate with the view\\n    function.\u0027, \u0027num_calls\u0027: 0, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.scaffold::before_request", "label": "before_request", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.scaffold::before_request\u0027, \u0027module\u0027: \u0027src.flask.sansio.scaffold\u0027, \u0027name\u0027: \u0027before_request\u0027, \u0027path\u0027: \u0027src/flask/sansio/scaffold.py\u0027, \u0027start_line\u0027: 460, \u0027end_line\u0027: 484, \u0027docstring\u0027: \u0027Register a function to run before each request.\\n\\nFor example, this can be used to open a database connection, or\\nto load the logged in user from the session.\\n\\n.. code-block:: python\\n\\n    @app.before_request\\n    def load_user():\\n        if \"user_id\" in session:\\n            g.user = db.session.get(session[\"user_id\"])\\n\\nThe function will be called without any arguments. If it returns\\na non-``None`` value, the value is handled as if it was the\\nreturn value from the view, and further request handling is\\nstopped.\\n\\nThis is available on both app and blueprint objects. When used on an app, this\\nexecutes before every request. When used on a blueprint, this executes before\\nevery request that the blueprint handles. To register with a blueprint and\\nexecute before every request, use :meth:`.Blueprint.before_app_request`.\u0027, \u0027num_calls\u0027: 2, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.scaffold::after_request", "label": "after_request", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.scaffold::after_request\u0027, \u0027module\u0027: \u0027src.flask.sansio.scaffold\u0027, \u0027name\u0027: \u0027after_request\u0027, \u0027path\u0027: \u0027src/flask/sansio/scaffold.py\u0027, \u0027start_line\u0027: 487, \u0027end_line\u0027: 505, \u0027docstring\u0027: \u0027Register a function to run after each request to this object.\\n\\nThe function is called with the response object, and must return\\na response object. This allows the functions to modify or\\nreplace the response before it is sent.\\n\\nIf a function raises an exception, any remaining\\n``after_request`` functions will not be called. Therefore, this\\nshould not be used for actions that must execute, such as to\\nclose resources. Use :meth:`teardown_request` for that.\\n\\nThis is available on both app and blueprint objects. When used on an app, this\\nexecutes after every request. When used on a blueprint, this executes after\\nevery request that the blueprint handles. To register with a blueprint and\\nexecute after every request, use :meth:`.Blueprint.after_app_request`.\u0027, \u0027num_calls\u0027: 2, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.scaffold::teardown_request", "label": "teardown_request", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.scaffold::teardown_request\u0027, \u0027module\u0027: \u0027src.flask.sansio.scaffold\u0027, \u0027name\u0027: \u0027teardown_request\u0027, \u0027path\u0027: \u0027src/flask/sansio/scaffold.py\u0027, \u0027start_line\u0027: 508, \u0027end_line\u0027: 539, \u0027docstring\u0027: \u0027Register a function to be called when the request context is\\npopped. Typically, this happens at the end of each request, but\\ncontexts may be pushed manually during testing.\\n\\n.. code-block:: python\\n\\n    with app.test_request_context():\\n        ...\\n\\nWhen the ``with`` block exits (or ``ctx.pop()`` is called), the\\nteardown functions are called just before the request context is\\nmade inactive.\\n\\nWhen a teardown function was called because of an unhandled\\nexception it will be passed an error object. If an\\n:meth:`errorhandler` is registered, it will handle the exception\\nand the teardown will not receive it.\\n\\nTeardown functions must avoid raising exceptions. If they\\nexecute code that might fail they must surround that code with a\\n``try``/``except`` block and log any errors.\\n\\nThe return values of teardown functions are ignored.\\n\\nThis is available on both app and blueprint objects. When used on an app, this\\nexecutes after every request. When used on a blueprint, this executes after\\nevery request that the blueprint handles. To register with a blueprint and\\nexecute after every request, use :meth:`.Blueprint.teardown_app_request`.\u0027, \u0027num_calls\u0027: 2, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.scaffold::context_processor", "label": "context_processor", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.scaffold::context_processor\u0027, \u0027module\u0027: \u0027src.flask.sansio.scaffold\u0027, \u0027name\u0027: \u0027context_processor\u0027, \u0027path\u0027: \u0027src/flask/sansio/scaffold.py\u0027, \u0027start_line\u0027: 542, \u0027end_line\u0027: 556, \u0027docstring\u0027: \"Registers a template context processor function. These functions run before\\nrendering a template. The keys of the returned dict are added as variables\\navailable in the template.\\n\\nThis is available on both app and blueprint objects. When used on an app, this\\nis called for every rendered template. When used on a blueprint, this is called\\nfor templates rendered from the blueprint\u0027s views. To register with a blueprint\\nand affect every template, use :meth:`.Blueprint.app_context_processor`.\", \u0027num_calls\u0027: 1, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.scaffold::url_value_preprocessor", "label": "url_value_preprocessor", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.scaffold::url_value_preprocessor\u0027, \u0027module\u0027: \u0027src.flask.sansio.scaffold\u0027, \u0027name\u0027: \u0027url_value_preprocessor\u0027, \u0027path\u0027: \u0027src/flask/sansio/scaffold.py\u0027, \u0027start_line\u0027: 559, \u0027end_line\u0027: 581, \u0027docstring\u0027: \u0027Register a URL value preprocessor function for all view\\nfunctions in the application. These functions will be called before the\\n:meth:`before_request` functions.\\n\\nThe function can modify the values captured from the matched url before\\nthey are passed to the view. For example, this can be used to pop a\\ncommon language code value and place it in ``g`` rather than pass it to\\nevery view.\\n\\nThe function is passed the endpoint name and values dict. The return\\nvalue is ignored.\\n\\nThis is available on both app and blueprint objects. When used on an app, this\\nis called for every request. When used on a blueprint, this is called for\\nrequests that the blueprint handles. To register with a blueprint and affect\\nevery request, use :meth:`.Blueprint.app_url_value_preprocessor`.\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.scaffold::url_defaults", "label": "url_defaults", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.scaffold::url_defaults\u0027, \u0027module\u0027: \u0027src.flask.sansio.scaffold\u0027, \u0027name\u0027: \u0027url_defaults\u0027, \u0027path\u0027: \u0027src/flask/sansio/scaffold.py\u0027, \u0027start_line\u0027: 584, \u0027end_line\u0027: 595, \u0027docstring\u0027: \"Callback function for URL defaults for all view functions of the\\napplication.  It\u0027s called with the endpoint and values and should\\nupdate the values passed in place.\\n\\nThis is available on both app and blueprint objects. When used on an app, this\\nis called for every request. When used on a blueprint, this is called for\\nrequests that the blueprint handles. To register with a blueprint and affect\\nevery request, use :meth:`.Blueprint.app_url_defaults`.\", \u0027num_calls\u0027: 1, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.scaffold::errorhandler", "label": "errorhandler", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.scaffold::errorhandler\u0027, \u0027module\u0027: \u0027src.flask.sansio.scaffold\u0027, \u0027name\u0027: \u0027errorhandler\u0027, \u0027path\u0027: \u0027src/flask/sansio/scaffold.py\u0027, \u0027start_line\u0027: 598, \u0027end_line\u0027: 639, \u0027docstring\u0027: \"Register a function to handle errors by code or exception class.\\n\\nA decorator that is used to register a function given an\\nerror code.  Example::\\n\\n    @app.errorhandler(404)\\n    def page_not_found(error):\\n        return \u0027This page does not exist\u0027, 404\\n\\nYou can also register handlers for arbitrary exceptions::\\n\\n    @app.errorhandler(DatabaseError)\\n    def special_exception_handler(error):\\n        return \u0027Database connection failed\u0027, 500\\n\\nThis is available on both app and blueprint objects. When used on an app, this\\ncan handle errors from every request. When used on a blueprint, this can handle\\nerrors from requests that the blueprint handles. To register with a blueprint\\nand affect every request, use :meth:`.Blueprint.app_errorhandler`.\\n\\n.. versionadded:: 0.7\\n    Use :meth:`register_error_handler` instead of modifying\\n    :attr:`error_handler_spec` directly, for application wide error\\n    handlers.\\n\\n.. versionadded:: 0.7\\n   One can now additionally also register custom exception types\\n   that do not necessarily have to be a subclass of the\\n   :class:`~werkzeug.exceptions.HTTPException` class.\\n\\n:param code_or_exception: the code as integer for the handler, or\\n                          an arbitrary exception\", \u0027num_calls\u0027: 1, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.scaffold::register_error_handler", "label": "register_error_handler", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.scaffold::register_error_handler\u0027, \u0027module\u0027: \u0027src.flask.sansio.scaffold\u0027, \u0027name\u0027: \u0027register_error_handler\u0027, \u0027path\u0027: \u0027src/flask/sansio/scaffold.py\u0027, \u0027start_line\u0027: 642, \u0027end_line\u0027: 654, \u0027docstring\u0027: \u0027Alternative error attach function to the :meth:`errorhandler`\\ndecorator that is more straightforward to use for non decorator\\nusage.\\n\\n.. versionadded:: 0.7\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.scaffold::_get_exc_class_and_code", "label": "_get_exc_class_and_code", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.scaffold::_get_exc_class_and_code\u0027, \u0027module\u0027: \u0027src.flask.sansio.scaffold\u0027, \u0027name\u0027: \u0027_get_exc_class_and_code\u0027, \u0027path\u0027: \u0027src/flask/sansio/scaffold.py\u0027, \u0027start_line\u0027: 657, \u0027end_line\u0027: 698, \u0027docstring\u0027: \u0027Get the exception class being handled. For HTTP status codes\\nor ``HTTPException`` subclasses, return both the exception and\\nstatus code.\\n\\n:param exc_class_or_code: Any exception class, or an HTTP status\\n    code as an integer.\u0027, \u0027num_calls\u0027: 7, \u0027decorators\u0027: [\u0027staticmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.scaffold::decorator", "label": "decorator", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.scaffold::decorator\u0027, \u0027module\u0027: \u0027src.flask.sansio.scaffold\u0027, \u0027name\u0027: \u0027decorator\u0027, \u0027path\u0027: \u0027src/flask/sansio/scaffold.py\u0027, \u0027start_line\u0027: 635, \u0027end_line\u0027: 637, \u0027docstring\u0027: None, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::_make_timedelta", "label": "_make_timedelta", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::_make_timedelta\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027_make_timedelta\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 52, \u0027end_line\u0027: 56, \u0027docstring\u0027: None, \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::App", "label": "App", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::App\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027App\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 59, \u0027end_line\u0027: 1006, \u0027docstring\u0027: \"The flask object implements a WSGI application and acts as the central\\nobject.  It is passed the name of the module or package of the\\napplication.  Once it is created it will act as a central registry for\\nthe view functions, the URL rules, template configuration and much more.\\n\\nThe name of the package is used to resolve resources from inside the\\npackage or the folder the module is contained in depending on if the\\npackage parameter resolves to an actual python package (a folder with\\nan :file:`__init__.py` file inside) or a standard module (just a ``.py`` file).\\n\\nFor more information about resource loading, see :func:`open_resource`.\\n\\nUsually you create a :class:`Flask` instance in your main module or\\nin the :file:`__init__.py` file of your package like this::\\n\\n    from flask import Flask\\n    app = Flask(__name__)\\n\\n.. admonition:: About the First Parameter\\n\\n    The idea of the first parameter is to give Flask an idea of what\\n    belongs to your application.  This name is used to find resources\\n    on the filesystem, can be used by extensions to improve debugging\\n    information and a lot more.\\n\\n    So it\u0027s important what you provide there.  If you are using a single\\n    module, `__name__` is always the correct value.  If you however are\\n    using a package, it\u0027s usually recommended to hardcode the name of\\n    your package there.\\n\\n    For example if your application is defined in :file:`yourapplication/app.py`\\n    you should create it with one of the two versions below::\\n\\n        app = Flask(\u0027yourapplication\u0027)\\n        app = Flask(__name__.split(\u0027.\u0027)[0])\\n\\n    Why is that?  The application will work even with `__name__`, thanks\\n    to how resources are looked up.  However it will make debugging more\\n    painful.  Certain extensions can make assumptions based on the\\n    import name of your application.  For example the Flask-SQLAlchemy\\n    extension will look for the code in your application that triggered\\n    an SQL query in debug mode.  If the import name is not properly set\\n    up, that debugging information is lost.  (For example it would only\\n    pick up SQL queries in `yourapplication.app` and not\\n    `yourapplication.views.frontend`)\\n\\n.. versionadded:: 0.7\\n   The `static_url_path`, `static_folder`, and `template_folder`\\n   parameters were added.\\n\\n.. versionadded:: 0.8\\n   The `instance_path` and `instance_relative_config` parameters were\\n   added.\\n\\n.. versionadded:: 0.11\\n   The `root_path` parameter was added.\\n\\n.. versionadded:: 1.0\\n   The ``host_matching`` and ``static_host`` parameters were added.\\n\\n.. versionadded:: 1.0\\n   The ``subdomain_matching`` parameter was added. Subdomain\\n   matching needs to be enabled manually now. Setting\\n   :data:`SERVER_NAME` does not implicitly enable it.\\n\\n:param import_name: the name of the application package\\n:param static_url_path: can be used to specify a different path for the\\n                        static files on the web.  Defaults to the name\\n                        of the `static_folder` folder.\\n:param static_folder: The folder with static files that is served at\\n    ``static_url_path``. Relative to the application ``root_path``\\n    or an absolute path. Defaults to ``\u0027static\u0027``.\\n:param static_host: the host to use when adding the static route.\\n    Defaults to None. Required when using ``host_matching=True``\\n    with a ``static_folder`` configured.\\n:param host_matching: set ``url_map.host_matching`` attribute.\\n    Defaults to False.\\n:param subdomain_matching: consider the subdomain relative to\\n    :data:`SERVER_NAME` when matching routes. Defaults to False.\\n:param template_folder: the folder that contains the templates that should\\n                        be used by the application.  Defaults to\\n                        ``\u0027templates\u0027`` folder in the root path of the\\n                        application.\\n:param instance_path: An alternative instance path for the application.\\n                      By default the folder ``\u0027instance\u0027`` next to the\\n                      package or module is assumed to be the instance\\n                      path.\\n:param instance_relative_config: if set to ``True`` relative filenames\\n                                 for loading the config are assumed to\\n                                 be relative to the instance path instead\\n                                 of the application root.\\n:param root_path: The path to the root of the application files.\\n    This should only be set manually when it can\u0027t be detected\\n    automatically, such as for namespace packages.\", \u0027num_calls\u0027: 65, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::__init__", "label": "__init__", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::__init__\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027__init__\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 279, \u0027end_line\u0027: 408, \u0027docstring\u0027: None, \u0027num_calls\u0027: 9, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::_check_setup_finished", "label": "_check_setup_finished", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::_check_setup_finished\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027_check_setup_finished\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 410, \u0027end_line\u0027: 420, \u0027docstring\u0027: None, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::name", "label": "name", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::name\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027name\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 423, \u0027end_line\u0027: 437, \u0027docstring\u0027: \"The name of the application.  This is usually the import name\\nwith the difference that it\u0027s guessed from the run file if the\\nimport name is main.  This name is used as a display name when\\nFlask needs the name of the application.  It can be set and overridden\\nto change the value.\\n\\n.. versionadded:: 0.8\", \u0027num_calls\u0027: 3, \u0027decorators\u0027: [\u0027cached_property\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::logger", "label": "logger", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::logger\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027logger\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 440, \u0027end_line\u0027: 464, \u0027docstring\u0027: \u0027A standard Python :class:`~logging.Logger` for the app, with\\nthe same name as :attr:`name`.\\n\\nIn debug mode, the logger\\\u0027s :attr:`~logging.Logger.level` will\\nbe set to :data:`~logging.DEBUG`.\\n\\nIf there are no handlers configured, a default handler will be\\nadded. See :doc:`/logging` for more information.\\n\\n.. versionchanged:: 1.1.0\\n    The logger takes the same name as :attr:`name` rather than\\n    hard-coding ``\"flask.app\"``.\\n\\n.. versionchanged:: 1.0.0\\n    Behavior was simplified. The logger is always named\\n    ``\"flask.app\"``. The level is only set during configuration,\\n    it doesn\\\u0027t check ``app.debug`` each time. Only one format is\\n    used, not different ones depending on ``app.debug``. No\\n    handlers are removed, and a handler is only added if no\\n    handlers are already configured.\\n\\n.. versionadded:: 0.3\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: [\u0027cached_property\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::jinja_env", "label": "jinja_env", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::jinja_env\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027jinja_env\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 467, \u0027end_line\u0027: 474, \u0027docstring\u0027: \u0027The Jinja environment used to load templates.\\n\\nThe environment is created the first time this property is\\naccessed. Changing :attr:`jinja_options` after that will have no\\neffect.\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: [\u0027cached_property\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::create_jinja_environment", "label": "create_jinja_environment", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::create_jinja_environment\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027create_jinja_environment\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 476, \u0027end_line\u0027: 477, \u0027docstring\u0027: None, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::make_config", "label": "make_config", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::make_config\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027make_config\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 479, \u0027end_line\u0027: 493, \u0027docstring\u0027: \u0027Used to create the config attribute by the Flask constructor.\\nThe `instance_relative` parameter is passed in from the constructor\\nof Flask (there named `instance_relative_config`) and indicates if\\nthe config should be relative to the instance path or the root path\\nof the application.\\n\\n.. versionadded:: 0.8\u0027, \u0027num_calls\u0027: 3, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::make_aborter", "label": "make_aborter", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::make_aborter\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027make_aborter\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 495, \u0027end_line\u0027: 505, \u0027docstring\u0027: \u0027Create the object to assign to :attr:`aborter`. That object\\nis called by :func:`flask.abort` to raise HTTP errors, and can\\nbe called directly as well.\\n\\nBy default, this creates an instance of :attr:`aborter_class`,\\nwhich defaults to :class:`werkzeug.exceptions.Aborter`.\\n\\n.. versionadded:: 2.2\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::auto_find_instance_path", "label": "auto_find_instance_path", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::auto_find_instance_path\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027auto_find_instance_path\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 507, \u0027end_line\u0027: 518, \u0027docstring\u0027: \u0027Tries to locate the instance path if it was not provided to the\\nconstructor of the application class.  It will basically calculate\\nthe path to a folder named ``instance`` next to your main file or\\nthe package.\\n\\n.. versionadded:: 0.8\u0027, \u0027num_calls\u0027: 3, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::create_global_jinja_loader", "label": "create_global_jinja_loader", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::create_global_jinja_loader\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027create_global_jinja_loader\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 520, \u0027end_line\u0027: 531, \u0027docstring\u0027: \"Creates the loader for the Jinja environment.  Can be used to\\noverride just the loader and keeping the rest unchanged.  It\u0027s\\ndiscouraged to override this function.  Instead one should override\\nthe :meth:`jinja_loader` function instead.\\n\\nThe global loader dispatches between the loaders of the application\\nand the individual blueprints.\\n\\n.. versionadded:: 0.7\", \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::select_jinja_autoescape", "label": "select_jinja_autoescape", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::select_jinja_autoescape\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027select_jinja_autoescape\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 533, \u0027end_line\u0027: 544, \u0027docstring\u0027: \u0027Returns ``True`` if autoescaping should be active for the given\\ntemplate name. If no template name is given, returns `True`.\\n\\n.. versionchanged:: 2.2\\n    Autoescaping is now enabled by default for ``.svg`` files.\\n\\n.. versionadded:: 0.5\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::debug", "label": "debug", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::debug\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027debug\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 560, \u0027end_line\u0027: 564, \u0027docstring\u0027: None, \u0027num_calls\u0027: 0, \u0027decorators\u0027: [\u0027setter\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::register_blueprint", "label": "register_blueprint", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::register_blueprint\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027register_blueprint\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 567, \u0027end_line\u0027: 592, \u0027docstring\u0027: \"Register a :class:`~flask.Blueprint` on the application. Keyword\\narguments passed to this method will override the defaults set on the\\nblueprint.\\n\\nCalls the blueprint\u0027s :meth:`~flask.Blueprint.register` method after\\nrecording the blueprint in the application\u0027s :attr:`blueprints`.\\n\\n:param blueprint: The blueprint to register.\\n:param url_prefix: Blueprint routes will be prefixed with this.\\n:param subdomain: Blueprint routes will match on this subdomain.\\n:param url_defaults: Blueprint routes will use these default values for\\n    view arguments.\\n:param options: Additional keyword arguments are passed to\\n    :class:`~flask.blueprints.BlueprintSetupState`. They can be\\n    accessed in :meth:`~flask.Blueprint.record` callbacks.\\n\\n.. versionchanged:: 2.0.1\\n    The ``name`` option can be used to change the (pre-dotted)\\n    name the blueprint is registered with. This allows the same\\n    blueprint to be registered multiple times with unique names\\n    for ``url_for``.\\n\\n.. versionadded:: 0.7\", \u0027num_calls\u0027: 1, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::iter_blueprints", "label": "iter_blueprints", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::iter_blueprints\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027iter_blueprints\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 594, \u0027end_line\u0027: 599, \u0027docstring\u0027: \u0027Iterates over all blueprints by the order they were registered.\\n\\n.. versionadded:: 0.11\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::add_url_rule", "label": "add_url_rule", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::add_url_rule\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027add_url_rule\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 602, \u0027end_line\u0027: 658, \u0027docstring\u0027: None, \u0027num_calls\u0027: 14, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::template_filter", "label": "template_filter", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::template_filter\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027template_filter\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 667, \u0027end_line\u0027: 693, \u0027docstring\u0027: \u0027Decorate a function to register it as a custom Jinja filter. The name\\nis optional. The decorator may be used without parentheses.\\n\\n.. code-block:: python\\n\\n    @app.template_filter(\"reverse\")\\n    def reverse_filter(s):\\n        return reversed(s)\\n\\nThe :meth:`add_template_filter` method may be used to register a\\nfunction later rather than decorating.\\n\\n:param name: The name to register the filter as. If not given, uses the\\n    function\\\u0027s name.\u0027, \u0027num_calls\u0027: 3, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::add_template_filter", "label": "add_template_filter", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::add_template_filter\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027add_template_filter\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 696, \u0027end_line\u0027: 708, \u0027docstring\u0027: \"Register a function to use as a custom Jinja filter.\\n\\nThe :meth:`template_filter` decorator can be used to register a function\\nby decorating instead.\\n\\n:param f: The function to register.\\n:param name: The name to register the filter as. If not given, uses the\\n    function\u0027s name.\", \u0027num_calls\u0027: 0, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::template_test", "label": "template_test", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::template_test\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027template_test\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 717, \u0027end_line\u0027: 750, \u0027docstring\u0027: \u0027Decorate a function to register it as a custom Jinja test. The name\\nis optional. The decorator may be used without parentheses.\\n\\n.. code-block:: python\\n\\n    @app.template_test(\"prime\")\\n    def is_prime_test(n):\\n        if n == 2:\\n            return True\\n        for i in range(2, int(math.ceil(math.sqrt(n))) + 1):\\n            if n % i == 0:\\n                return False\\n      return True\\n\\nThe :meth:`add_template_test` method may be used to register a function\\nlater rather than decorating.\\n\\n:param name: The name to register the filter as. If not given, uses the\\n    function\\\u0027s name.\\n\\n.. versionadded:: 0.10\u0027, \u0027num_calls\u0027: 3, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::add_template_test", "label": "add_template_test", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::add_template_test\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027add_template_test\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 753, \u0027end_line\u0027: 767, \u0027docstring\u0027: \"Register a function to use as a custom Jinja test.\\n\\nThe :meth:`template_test` decorator can be used to register a function\\nby decorating instead.\\n\\n:param f: The function to register.\\n:param name: The name to register the test as. If not given, uses the\\n    function\u0027s name.\\n\\n.. versionadded:: 0.10\", \u0027num_calls\u0027: 0, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::template_global", "label": "template_global", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::template_global\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027template_global\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 776, \u0027end_line\u0027: 804, \u0027docstring\u0027: \"Decorate a function to register it as a custom Jinja global. The name\\nis optional. The decorator may be used without parentheses.\\n\\n.. code-block:: python\\n\\n    @app.template_global\\n    def double(n):\\n        return 2 * n\\n\\nThe :meth:`add_template_global` method may be used to register a\\nfunction later rather than decorating.\\n\\n:param name: The name to register the global as. If not given, uses the\\n    function\u0027s name.\\n\\n.. versionadded:: 0.10\", \u0027num_calls\u0027: 3, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::add_template_global", "label": "add_template_global", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::add_template_global\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027add_template_global\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 807, \u0027end_line\u0027: 821, \u0027docstring\u0027: \"Register a function to use as a custom Jinja global.\\n\\nThe :meth:`template_global` decorator can be used to register a function\\nby decorating instead.\\n\\n:param f: The function to register.\\n:param name: The name to register the global as. If not given, uses the\\n    function\u0027s name.\\n\\n.. versionadded:: 0.10\", \u0027num_calls\u0027: 0, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::teardown_appcontext", "label": "teardown_appcontext", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::teardown_appcontext\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027teardown_appcontext\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 824, \u0027end_line\u0027: 852, \u0027docstring\u0027: \u0027Registers a function to be called when the app context is popped. The\\ncontext is popped at the end of a request, CLI command, or manual ``with``\\nblock.\\n\\n.. code-block:: python\\n\\n    with app.app_context():\\n        ...\\n\\nWhen the ``with`` block exits (or ``ctx.pop()`` is called), the\\nteardown functions are called just before the app context is\\nmade inactive.\\n\\nWhen a teardown function was called because of an unhandled\\nexception it will be passed an error object. If an\\n:meth:`errorhandler` is registered, it will handle the exception\\nand the teardown will not receive it.\\n\\nTeardown functions must avoid raising exceptions. If they\\nexecute code that might fail they must surround that code with a\\n``try``/``except`` block and log any errors.\\n\\nThe return values of teardown functions are ignored.\\n\\n.. versionadded:: 0.9\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::shell_context_processor", "label": "shell_context_processor", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::shell_context_processor\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027shell_context_processor\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 855, \u0027end_line\u0027: 863, \u0027docstring\u0027: \u0027Registers a shell context processor function.\\n\\n.. versionadded:: 0.11\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::_find_error_handler", "label": "_find_error_handler", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::_find_error_handler\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027_find_error_handler\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 865, \u0027end_line\u0027: 888, \u0027docstring\u0027: \u0027Return a registered error handler for an exception in this order:\\nblueprint handler for a specific code, app handler for a specific code,\\nblueprint handler for an exception class, app handler for an exception\\nclass, or ``None`` if a suitable handler is not found.\u0027, \u0027num_calls\u0027: 3, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::trap_http_exception", "label": "trap_http_exception", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::trap_http_exception\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027trap_http_exception\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 890, \u0027end_line\u0027: 923, \u0027docstring\u0027: \u0027Checks if an HTTP exception should be trapped or not.  By default\\nthis will return ``False`` for all exceptions except for a bad request\\nkey error if ``TRAP_BAD_REQUEST_ERRORS`` is set to ``True``.  It\\nalso returns ``True`` if ``TRAP_HTTP_EXCEPTIONS`` is set to ``True``.\\n\\nThis is called for all HTTP exceptions raised by a view function.\\nIf it returns ``True`` for any exception the error handler for this\\nexception is not called and it shows up as regular exception in the\\ntraceback.  This is helpful for debugging implicitly raised HTTP\\nexceptions.\\n\\n.. versionchanged:: 1.0\\n    Bad request errors are not trapped by default in debug mode.\\n\\n.. versionadded:: 0.8\u0027, \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::should_ignore_error", "label": "should_ignore_error", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::should_ignore_error\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027should_ignore_error\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 925, \u0027end_line\u0027: 933, \u0027docstring\u0027: \u0027This is called to figure out if an error should be ignored\\nor not as far as the teardown system is concerned.  If this\\nfunction returns ``True`` then the teardown handlers will not be\\npassed the error.\\n\\n.. versionadded:: 0.10\u0027, \u0027num_calls\u0027: 0, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::redirect", "label": "redirect", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::redirect\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027redirect\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 935, \u0027end_line\u0027: 951, \u0027docstring\u0027: \u0027Create a redirect response object.\\n\\nThis is called by :func:`flask.redirect`, and can be called\\ndirectly as well.\\n\\n:param location: The URL to redirect to.\\n:param code: The status code for the redirect.\\n\\n.. versionadded:: 2.2\\n    Moved from ``flask.redirect``, which calls this method.\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::inject_url_defaults", "label": "inject_url_defaults", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::inject_url_defaults\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027inject_url_defaults\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 953, \u0027end_line\u0027: 972, \u0027docstring\u0027: \u0027Injects the URL defaults for the given endpoint directly into\\nthe values dictionary passed.  This is used internally and\\nautomatically called on URL building.\\n\\n.. versionadded:: 0.7\u0027, \u0027num_calls\u0027: 5, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::handle_url_build_error", "label": "handle_url_build_error", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::handle_url_build_error\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027handle_url_build_error\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 974, \u0027end_line\u0027: 1006, \u0027docstring\u0027: \u0027Called by :meth:`.url_for` if a\\n:exc:`~werkzeug.routing.BuildError` was raised. If this returns\\na value, it will be returned by ``url_for``, otherwise the error\\nwill be re-raised.\\n\\nEach function in :attr:`url_build_error_handlers` is called with\\n``error``, ``endpoint`` and ``values``. If a function returns\\n``None`` or raises a ``BuildError``, it is skipped. Otherwise,\\nits return value is returned by ``url_for``.\\n\\n:param error: The active ``BuildError`` being handled.\\n:param endpoint: The endpoint being built.\\n:param values: The keyword arguments passed to ``url_for``.\u0027, \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.app::decorator", "label": "decorator", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.app::decorator\u0027, \u0027module\u0027: \u0027src.flask.sansio.app\u0027, \u0027name\u0027: \u0027decorator\u0027, \u0027path\u0027: \u0027src/flask/sansio/app.py\u0027, \u0027start_line\u0027: 800, \u0027end_line\u0027: 802, \u0027docstring\u0027: None, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.blueprints::BlueprintSetupState", "label": "BlueprintSetupState", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.blueprints::BlueprintSetupState\u0027, \u0027module\u0027: \u0027src.flask.sansio.blueprints\u0027, \u0027name\u0027: \u0027BlueprintSetupState\u0027, \u0027path\u0027: \u0027src/flask/sansio/blueprints.py\u0027, \u0027start_line\u0027: 34, \u0027end_line\u0027: 116, \u0027docstring\u0027: \u0027Temporary holder object for registering a blueprint with the\\napplication.  An instance of this class is created by the\\n:meth:`~flask.Blueprint.make_setup_state` method and later passed\\nto all register callback functions.\u0027, \u0027num_calls\u0027: 16, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.blueprints::Blueprint", "label": "Blueprint", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.blueprints::Blueprint\u0027, \u0027module\u0027: \u0027src.flask.sansio.blueprints\u0027, \u0027name\u0027: \u0027Blueprint\u0027, \u0027path\u0027: \u0027src/flask/sansio/blueprints.py\u0027, \u0027start_line\u0027: 119, \u0027end_line\u0027: 692, \u0027docstring\u0027: \"Represents a blueprint, a collection of routes and other\\napp-related functions that can be registered on a real application\\nlater.\\n\\nA blueprint is an object that allows defining application functions\\nwithout requiring an application object ahead of time. It uses the\\nsame decorators as :class:`~flask.Flask`, but defers the need for an\\napplication by recording them for later registration.\\n\\nDecorating a function with a blueprint creates a deferred function\\nthat is called with :class:`~flask.blueprints.BlueprintSetupState`\\nwhen the blueprint is registered on an application.\\n\\nSee :doc:`/blueprints` for more information.\\n\\n:param name: The name of the blueprint. Will be prepended to each\\n    endpoint name.\\n:param import_name: The name of the blueprint package, usually\\n    ``__name__``. This helps locate the ``root_path`` for the\\n    blueprint.\\n:param static_folder: A folder with static files that should be\\n    served by the blueprint\u0027s static route. The path is relative to\\n    the blueprint\u0027s root path. Blueprint static files are disabled\\n    by default.\\n:param static_url_path: The url to serve static files from.\\n    Defaults to ``static_folder``. If the blueprint does not have\\n    a ``url_prefix``, the app\u0027s static route will take precedence,\\n    and the blueprint\u0027s static files won\u0027t be accessible.\\n:param template_folder: A folder with templates that should be added\\n    to the app\u0027s template search path. The path is relative to the\\n    blueprint\u0027s root path. Blueprint templates are disabled by\\n    default. Blueprint templates have a lower precedence than those\\n    in the app\u0027s templates folder.\\n:param url_prefix: A path to prepend to all of the blueprint\u0027s URLs,\\n    to make them distinct from the rest of the app\u0027s routes.\\n:param subdomain: A subdomain that blueprint routes will match on by\\n    default.\\n:param url_defaults: A dict of default values that blueprint routes\\n    will receive by default.\\n:param root_path: By default, the blueprint will automatically set\\n    this based on ``import_name``. In certain situations this\\n    automatic detection can fail, so the path can be specified\\n    manually instead.\\n\\n.. versionchanged:: 1.1.0\\n    Blueprints have a ``cli`` group to register nested CLI commands.\\n    The ``cli_group`` parameter controls the name of the group under\\n    the ``flask`` command.\\n\\n.. versionadded:: 0.7\", \u0027num_calls\u0027: 85, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.blueprints::__init__", "label": "__init__", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.blueprints::__init__\u0027, \u0027module\u0027: \u0027src.flask.sansio.blueprints\u0027, \u0027name\u0027: \u0027__init__\u0027, \u0027path\u0027: \u0027src/flask/sansio/blueprints.py\u0027, \u0027start_line\u0027: 174, \u0027end_line\u0027: 211, \u0027docstring\u0027: None, \u0027num_calls\u0027: 4, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.blueprints::add_url_rule", "label": "add_url_rule", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.blueprints::add_url_rule\u0027, \u0027module\u0027: \u0027src.flask.sansio.blueprints\u0027, \u0027name\u0027: \u0027add_url_rule\u0027, \u0027path\u0027: \u0027src/flask/sansio/blueprints.py\u0027, \u0027start_line\u0027: 413, \u0027end_line\u0027: 441, \u0027docstring\u0027: \"Register a URL rule with the blueprint. See :meth:`.Flask.add_url_rule` for\\nfull documentation.\\n\\nThe URL rule is prefixed with the blueprint\u0027s URL prefix. The endpoint name,\\nused with :func:`url_for`, is prefixed with the blueprint\u0027s name.\", \u0027num_calls\u0027: 5, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.blueprints::_check_setup_finished", "label": "_check_setup_finished", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.blueprints::_check_setup_finished\u0027, \u0027module\u0027: \u0027src.flask.sansio.blueprints\u0027, \u0027name\u0027: \u0027_check_setup_finished\u0027, \u0027path\u0027: \u0027src/flask/sansio/blueprints.py\u0027, \u0027start_line\u0027: 213, \u0027end_line\u0027: 221, \u0027docstring\u0027: None, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.blueprints::record", "label": "record", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.blueprints::record\u0027, \u0027module\u0027: \u0027src.flask.sansio.blueprints\u0027, \u0027name\u0027: \u0027record\u0027, \u0027path\u0027: \u0027src/flask/sansio/blueprints.py\u0027, \u0027start_line\u0027: 224, \u0027end_line\u0027: 230, \u0027docstring\u0027: \u0027Registers a function that is called when the blueprint is\\nregistered on the application.  This function is called with the\\nstate as argument as returned by the :meth:`make_setup_state`\\nmethod.\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.blueprints::record_once", "label": "record_once", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.blueprints::record_once\u0027, \u0027module\u0027: \u0027src.flask.sansio.blueprints\u0027, \u0027name\u0027: \u0027record_once\u0027, \u0027path\u0027: \u0027src/flask/sansio/blueprints.py\u0027, \u0027start_line\u0027: 233, \u0027end_line\u0027: 244, \u0027docstring\u0027: \u0027Works like :meth:`record` but wraps the function in another\\nfunction that will ensure the function is only called once.  If the\\nblueprint is registered a second time on the application, the\\nfunction passed is not called.\u0027, \u0027num_calls\u0027: 3, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.blueprints::make_setup_state", "label": "make_setup_state", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.blueprints::make_setup_state\u0027, \u0027module\u0027: \u0027src.flask.sansio.blueprints\u0027, \u0027name\u0027: \u0027make_setup_state\u0027, \u0027path\u0027: \u0027src/flask/sansio/blueprints.py\u0027, \u0027start_line\u0027: 246, \u0027end_line\u0027: 253, \u0027docstring\u0027: \u0027Creates an instance of :meth:`~flask.blueprints.BlueprintSetupState`\\nobject that is later passed to the register callback functions.\\nSubclasses can override this to return a subclass of the setup state.\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.blueprints::register_blueprint", "label": "register_blueprint", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.blueprints::register_blueprint\u0027, \u0027module\u0027: \u0027src.flask.sansio.blueprints\u0027, \u0027name\u0027: \u0027register_blueprint\u0027, \u0027path\u0027: \u0027src/flask/sansio/blueprints.py\u0027, \u0027start_line\u0027: 256, \u0027end_line\u0027: 271, \u0027docstring\u0027: \u0027Register a :class:`~flask.Blueprint` on this blueprint. Keyword\\narguments passed to this method will override the defaults set\\non the blueprint.\\n\\n.. versionchanged:: 2.0.1\\n    The ``name`` option can be used to change the (pre-dotted)\\n    name the blueprint is registered with. This allows the same\\n    blueprint to be registered multiple times with unique names\\n    for ``url_for``.\\n\\n.. versionadded:: 2.0\u0027, \u0027num_calls\u0027: 2, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.blueprints::register", "label": "register", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.blueprints::register\u0027, \u0027module\u0027: \u0027src.flask.sansio.blueprints\u0027, \u0027name\u0027: \u0027register\u0027, \u0027path\u0027: \u0027src/flask/sansio/blueprints.py\u0027, \u0027start_line\u0027: 273, \u0027end_line\u0027: 377, \u0027docstring\u0027: \u0027Called by :meth:`Flask.register_blueprint` to register all\\nviews and callbacks registered on the blueprint with the\\napplication. Creates a :class:`.BlueprintSetupState` and calls\\neach :meth:`record` callback with it.\\n\\n:param app: The application this blueprint is being registered\\n    with.\\n:param options: Keyword arguments forwarded from\\n    :meth:`~Flask.register_blueprint`.\\n\\n.. versionchanged:: 2.3\\n    Nested blueprints now correctly apply subdomains.\\n\\n.. versionchanged:: 2.1\\n    Registering the same blueprint with the same name multiple\\n    times is an error.\\n\\n.. versionchanged:: 2.0.1\\n    Nested blueprints are registered with their dotted name.\\n    This allows different blueprints with the same name to be\\n    nested at different locations.\\n\\n.. versionchanged:: 2.0.1\\n    The ``name`` option can be used to change the (pre-dotted)\\n    name the blueprint is registered with. This allows the same\\n    blueprint to be registered multiple times with unique names\\n    for ``url_for``.\u0027, \u0027num_calls\u0027: 20, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.blueprints::_merge_blueprint_funcs", "label": "_merge_blueprint_funcs", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.blueprints::_merge_blueprint_funcs\u0027, \u0027module\u0027: \u0027src.flask.sansio.blueprints\u0027, \u0027name\u0027: \u0027_merge_blueprint_funcs\u0027, \u0027path\u0027: \u0027src/flask/sansio/blueprints.py\u0027, \u0027start_line\u0027: 379, \u0027end_line\u0027: 410, \u0027docstring\u0027: None, \u0027num_calls\u0027: 13, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.blueprints::app_template_filter", "label": "app_template_filter", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.blueprints::app_template_filter\u0027, \u0027module\u0027: \u0027src.flask.sansio.blueprints\u0027, \u0027name\u0027: \u0027app_template_filter\u0027, \u0027path\u0027: \u0027src/flask/sansio/blueprints.py\u0027, \u0027start_line\u0027: 450, \u0027end_line\u0027: 473, \u0027docstring\u0027: \"Decorate a function to register it as a custom Jinja filter. The name\\nis optional. The decorator may be used without parentheses.\\n\\nThe :meth:`add_app_template_filter` method may be used to register a\\nfunction later rather than decorating.\\n\\nThe filter is available in all templates, not only those under this\\nblueprint. Equivalent to :meth:`.Flask.template_filter`.\\n\\n:param name: The name to register the filter as. If not given, uses the\\n    function\u0027s name.\", \u0027num_calls\u0027: 3, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.blueprints::add_app_template_filter", "label": "add_app_template_filter", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.blueprints::add_app_template_filter\u0027, \u0027module\u0027: \u0027src.flask.sansio.blueprints\u0027, \u0027name\u0027: \u0027add_app_template_filter\u0027, \u0027path\u0027: \u0027src/flask/sansio/blueprints.py\u0027, \u0027start_line\u0027: 476, \u0027end_line\u0027: 495, \u0027docstring\u0027: \"Register a function to use as a custom Jinja filter.\\n\\nThe :meth:`app_template_filter` decorator can be used to register a\\nfunction by decorating instead.\\n\\nThe filter is available in all templates, not only those under this\\nblueprint. Equivalent to :meth:`.Flask.add_template_filter`.\\n\\n:param f: The function to register.\\n:param name: The name to register the filter as. If not given, uses the\\n    function\u0027s name.\", \u0027num_calls\u0027: 2, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.blueprints::app_template_test", "label": "app_template_test", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.blueprints::app_template_test\u0027, \u0027module\u0027: \u0027src.flask.sansio.blueprints\u0027, \u0027name\u0027: \u0027app_template_test\u0027, \u0027path\u0027: \u0027src/flask/sansio/blueprints.py\u0027, \u0027start_line\u0027: 504, \u0027end_line\u0027: 529, \u0027docstring\u0027: \"Decorate a function to register it as a custom Jinja test. The name\\nis optional. The decorator may be used without parentheses.\\n\\nThe :meth:`add_app_template_test` method may be used to register a\\nfunction later rather than decorating.\\n\\nThe test is available in all templates, not only those under this\\nblueprint. Equivalent to :meth:`.Flask.template_test`.\\n\\n:param name: The name to register the filter as. If not given, uses the\\n    function\u0027s name.\\n\\n.. versionadded:: 0.10\", \u0027num_calls\u0027: 3, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.blueprints::add_app_template_test", "label": "add_app_template_test", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.blueprints::add_app_template_test\u0027, \u0027module\u0027: \u0027src.flask.sansio.blueprints\u0027, \u0027name\u0027: \u0027add_app_template_test\u0027, \u0027path\u0027: \u0027src/flask/sansio/blueprints.py\u0027, \u0027start_line\u0027: 532, \u0027end_line\u0027: 553, \u0027docstring\u0027: \"Register a function to use as a custom Jinja test.\\n\\nThe :meth:`app_template_test` decorator can be used to register a\\nfunction by decorating instead.\\n\\nThe test is available in all templates, not only those under this\\nblueprint. Equivalent to :meth:`.Flask.add_template_test`.\\n\\n:param f: The function to register.\\n:param name: The name to register the test as. If not given, uses the\\n    function\u0027s name.\\n\\n.. versionadded:: 0.10\", \u0027num_calls\u0027: 2, \u0027decorators\u0027: [\u0027setupmethod\u0027]}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.blueprints::app_template_global", "label": "app_template_global", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.blueprints::app_template_global\u0027, \u0027module\u0027: \u0027src.flask.sansio.blueprints\u0027, \u0027name\u0027: \u0027app_template_global\u0027, \u0027path\u0027: \u0027src/flask/sansio/blueprints.py\u0027, \u0027start_line\u0027: 562, \u0027end_line\u0027: 587, \u0027docstring\u0027: \"Decorate a function to register it as a custom Jinja global. The name\\nis optional. The decorator may be used without parentheses.\\n\\nThe :meth:`add_app_template_global` method may be used to register a\\nfunction later rather than decorating.\\n\\nThe global is available in all templates, not only those under this\\nblueprint. Equivalent to :meth:`.Flask.template_global`.\\n\\n:param name:
