027start_line\u0027: 608, \u0027end_line\u0027: 609, \u0027docstring\u0027: None, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.sansio.blueprints::from_blueprint", "label": "from_blueprint", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.sansio.blueprints::from_blueprint\u0027, \u0027module\u0027: \u0027src.flask.sansio.blueprints\u0027, \u0027name\u0027: \u0027from_blueprint\u0027, \u0027path\u0027: \u0027src/flask/sansio/blueprints.py\u0027, \u0027start_line\u0027: 664, \u0027end_line\u0027: 665, \u0027docstring\u0027: None, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.json.__init__::dumps", "label": "dumps", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.json.__init__::dumps\u0027, \u0027module\u0027: \u0027src.flask.json.__init__\u0027, \u0027name\u0027: \u0027dumps\u0027, \u0027path\u0027: \u0027src/flask/json/__init__.py\u0027, \u0027start_line\u0027: 13, \u0027end_line\u0027: 44, \u0027docstring\u0027: \u0027Serialize data as JSON.\\n\\nIf :data:`~flask.current_app` is available, it will use its\\n:meth:`app.json.dumps() \u003cflask.json.provider.JSONProvider.dumps\u003e`\\nmethod, otherwise it will use :func:`json.dumps`.\\n\\n:param obj: The data to serialize.\\n:param kwargs: Arguments passed to the ``dumps`` implementation.\\n\\n.. versionchanged:: 2.3\\n    The ``app`` parameter was removed.\\n\\n.. versionchanged:: 2.2\\n    Calls ``current_app.json.dumps``, allowing an app to override\\n    the behavior.\\n\\n.. versionchanged:: 2.0.2\\n    :class:`decimal.Decimal` is supported by converting to a string.\\n\\n.. versionchanged:: 2.0\\n    ``encoding`` will be removed in Flask 2.1.\\n\\n.. versionchanged:: 1.0.3\\n    ``app`` can be passed directly, rather than requiring an app\\n    context for configuration.\u0027, \u0027num_calls\u0027: 3, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.json.__init__::dump", "label": "dump", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.json.__init__::dump\u0027, \u0027module\u0027: \u0027src.flask.json.__init__\u0027, \u0027name\u0027: \u0027dump\u0027, \u0027path\u0027: \u0027src/flask/json/__init__.py\u0027, \u0027start_line\u0027: 47, \u0027end_line\u0027: 74, \u0027docstring\u0027: \u0027Serialize data as JSON and write to a file.\\n\\nIf :data:`~flask.current_app` is available, it will use its\\n:meth:`app.json.dump() \u003cflask.json.provider.JSONProvider.dump\u003e`\\nmethod, otherwise it will use :func:`json.dump`.\\n\\n:param obj: The data to serialize.\\n:param fp: A file opened for writing text. Should use the UTF-8\\n    encoding to be valid JSON.\\n:param kwargs: Arguments passed to the ``dump`` implementation.\\n\\n.. versionchanged:: 2.3\\n    The ``app`` parameter was removed.\\n\\n.. versionchanged:: 2.2\\n    Calls ``current_app.json.dump``, allowing an app to override\\n    the behavior.\\n\\n.. versionchanged:: 2.0\\n    Writing to a binary file, and the ``encoding`` argument, will be\\n    removed in Flask 2.1.\u0027, \u0027num_calls\u0027: 3, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.json.__init__::loads", "label": "loads", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.json.__init__::loads\u0027, \u0027module\u0027: \u0027src.flask.json.__init__\u0027, \u0027name\u0027: \u0027loads\u0027, \u0027path\u0027: \u0027src/flask/json/__init__.py\u0027, \u0027start_line\u0027: 77, \u0027end_line\u0027: 105, \u0027docstring\u0027: \u0027Deserialize data as JSON.\\n\\nIf :data:`~flask.current_app` is available, it will use its\\n:meth:`app.json.loads() \u003cflask.json.provider.JSONProvider.loads\u003e`\\nmethod, otherwise it will use :func:`json.loads`.\\n\\n:param s: Text or UTF-8 bytes.\\n:param kwargs: Arguments passed to the ``loads`` implementation.\\n\\n.. versionchanged:: 2.3\\n    The ``app`` parameter was removed.\\n\\n.. versionchanged:: 2.2\\n    Calls ``current_app.json.loads``, allowing an app to override\\n    the behavior.\\n\\n.. versionchanged:: 2.0\\n    ``encoding`` will be removed in Flask 2.1. The data must be a\\n    string or UTF-8 bytes.\\n\\n.. versionchanged:: 1.0.3\\n    ``app`` can be passed directly, rather than requiring an app\\n    context for configuration.\u0027, \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.json.__init__::load", "label": "load", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.json.__init__::load\u0027, \u0027module\u0027: \u0027src.flask.json.__init__\u0027, \u0027name\u0027: \u0027load\u0027, \u0027path\u0027: \u0027src/flask/json/__init__.py\u0027, \u0027start_line\u0027: 108, \u0027end_line\u0027: 135, \u0027docstring\u0027: \u0027Deserialize data as JSON read from a file.\\n\\nIf :data:`~flask.current_app` is available, it will use its\\n:meth:`app.json.load() \u003cflask.json.provider.JSONProvider.load\u003e`\\nmethod, otherwise it will use :func:`json.load`.\\n\\n:param fp: A file opened for reading text or UTF-8 bytes.\\n:param kwargs: Arguments passed to the ``load`` implementation.\\n\\n.. versionchanged:: 2.3\\n    The ``app`` parameter was removed.\\n\\n.. versionchanged:: 2.2\\n    Calls ``current_app.json.load``, allowing an app to override\\n    the behavior.\\n\\n.. versionchanged:: 2.2\\n    The ``app`` parameter will be removed in Flask 2.3.\\n\\n.. versionchanged:: 2.0\\n    ``encoding`` will be removed in Flask 2.1. The file must be text\\n    mode, or binary mode with UTF-8 bytes.\u0027, \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.json.__init__::jsonify", "label": "jsonify", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.json.__init__::jsonify\u0027, \u0027module\u0027: \u0027src.flask.json.__init__\u0027, \u0027name\u0027: \u0027jsonify\u0027, \u0027path\u0027: \u0027src/flask/json/__init__.py\u0027, \u0027start_line\u0027: 138, \u0027end_line\u0027: 170, \u0027docstring\u0027: \u0027Serialize the given arguments as JSON, and return a\\n:class:`~flask.Response` object with the ``application/json``\\nmimetype. A dict or list returned from a view will be converted to a\\nJSON response automatically without needing to call this.\\n\\nThis requires an active app context, and calls\\n:meth:`app.json.response() \u003cflask.json.provider.JSONProvider.response\u003e`.\\n\\nIn debug mode, the output is formatted with indentation to make it\\neasier to read. This may also be controlled by the provider.\\n\\nEither positional or keyword arguments can be given, not both.\\nIf no arguments are given, ``None`` is serialized.\\n\\n:param args: A single value to serialize, or multiple values to\\n    treat as a list to serialize.\\n:param kwargs: Treat as a dict to serialize.\\n\\n.. versionchanged:: 2.2\\n    Calls ``current_app.json.response``, allowing an app to override\\n    the behavior.\\n\\n.. versionchanged:: 2.0.2\\n    :class:`decimal.Decimal` is supported by converting to a string.\\n\\n.. versionchanged:: 0.11\\n    Added support for serializing top-level arrays. This was a\\n    security risk in ancient browsers. See :ref:`security-json`.\\n\\n.. versionadded:: 0.2\u0027, \u0027num_calls\u0027: 1, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.json.tag::JSONTag", "label": "JSONTag", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.json.tag::JSONTag\u0027, \u0027module\u0027: \u0027src.flask.json.tag\u0027, \u0027name\u0027: \u0027JSONTag\u0027, \u0027p pe": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.json.tag::_untag_scan\u0027, \u0027module\u0027: \u0027src.flask.json.tag\u0027, \u0027name\u0027: \u0027_untag_scan\u0027, \u0027path\u0027: \u0027src/flask/json/tag.py\u0027, \u0027start_line\u0027: 309, \u0027end_line\u0027: 319, \u0027docstring\u0027: None, \u0027num_calls\u0027: 6, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.json.tag::dumps", "label": "dumps", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.json.tag::dumps\u0027, \u0027module\u0027: \u0027src.flask.json.tag\u0027, \u0027name\u0027: \u0027dumps\u0027, \u0027path\u0027: \u0027src/flask/json/tag.py\u0027, \u0027start_line\u0027: 321, \u0027end_line\u0027: 323, \u0027docstring\u0027: \u0027Tag the value and dump it to a compact JSON string.\u0027, \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.json.tag::loads", "label": "loads", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.json.tag::loads\u0027, \u0027module\u0027: \u0027src.flask.json.tag\u0027, \u0027name\u0027: \u0027loads\u0027, \u0027path\u0027: \u0027src/flask/json/tag.py\u0027, \u0027start_line\u0027: 325, \u0027end_line\u0027: 327, \u0027docstring\u0027: \u0027Load data from a JSON string and deserialized any tagged objects.\u0027, \u0027num_calls\u0027: 2, \u0027decorators\u0027: []}"}, {"color": "#66cc66", "id": "function:src.flask.json.provider::JSONProvider", "label": "JSONProvider", "shape": "dot", "title": "{\u0027node_type\u0027: \u0027Function\u0027, \u0027symbol_id\u0027: \u0027src.flask.json.provider::JSONProvider\u0027, \u0027module\u0027: \u0027src.flask.json.provider\u0027, \u0027name\u0027: \u0027JSONProvider\u0027, \u0027path\u0027: \u0027src/flask/json/provider.py\u0027, \u0027start_line\u0027: 19, \u002
